	(54, '2024-01-24 14:36:55', 0, '0901090917', 'HS0912230850471728', 'DV0912230850474814', 'DV0912230858384265', 'Điều trị mụn cấp 2', 'NDV0912231450470001', 1, 90, 0, 1640000, '', '', 'DV09122308583842651887.jpg|DV09122308583842654509.jpg|', 0, 0, 10, 0),
	(55, '2023-12-28 08:01:30', 0, '0901090917', 'HS0912230850471728', 'DV0912230850474814', 'DV0912230900116513', 'Dưỡng trắng da mặt', 'NDV0912231450470005', 0, 30, 300000, 70000, '<p>Dưỡng trắng da mặt hằng ng&agrave;y mang lại lợi &iacute;ch g&igrave;? Nếu bạn chịu tu&acirc;n theo liệu tr&igrave;nh dưỡng trắng da mặt h&agrave;ng ng&agrave;y, bạn sẽ thấy những lợi &iacute;ch nhau: Da chậm l&atilde;o ho&aacute; hơn: C&aacute;c tế b&agrave;o da sẽ được chăm s&oacute;c tốt, sẽ c&oacute; độ đ&agrave;n hồi tốt hơn v&agrave; chậm l&atilde;o ho&aacute;. Da được sạch s&acirc;u: Khi chăm s&oacute;c da mỗi ng&agrave;y, bạn sẽ thấy t&igrave;nh trạng da cải thiện. V&igrave; n&oacute; sẽ tho&aacute;t khỏi độc tố, bụi bẩn v&agrave; c&aacute;c vi khuẩn c&oacute; hại h&agrave;ng ng&agrave;y. Da trắng đẹp mịn m&agrave;ng: C&aacute;c loại mỹ phẩm bạn sử dụng h&agrave;ng ng&agrave;y sẽ gi&uacute;p bạn c&oacute; được l&agrave;n da trắng hồng, đ&aacute;ng mong ước.</p>\r\n', '', '', 10, 15, 10, 15),
