	(111, '2023-12-27 10:41:13', 0, '0853728151', 'HS2712230432197290', 'DV2712230432197849', 'DV2712230441136489', 'soi da', 'NDV2712230441082430', 0, 10, 1000, 1000, '', 'DV27122304411364894128.mp4', 'DV27122304411364891281.jpg|DV27122304411364892995.jpg|', 0, 0, 0, 90),
	(112, '2023-12-27 10:42:00', 0, '0853728151', 'HS2712230432197290', 'DV2712230432197849', 'DV2712230442003918', 'Chăm sóc da', 'NDV2712230441082430', 2, 0, 0, 0, '', 'DV27122304420039182590.mp4', 'DV27122304420039183174.jpg|', 0, 0, 0, 0),
	(114, '2024-01-24 14:57:48', 0, '0901090917', 'HS0912230850471728', 'DV0912230850474814', 'DV0301240917418524', 'Điều trị nám công nghệ Nano Hàn Quốc', 'NDV0301240913594134', 1, 0, 0, 540000, '<h3><strong>Sử dụng sản phẩm c&oacute; th&agrave;nh phần Hydroquinone</strong></h3>\r\n\r\n<p>Hydroquinone l&agrave; hoạt chất đầu bảng trong c&aacute;c th&agrave;nh phần điều trị n&aacute;m, l&agrave;m việc theo cơ chế ức chế enzyme Tyrosinase, gi&uacute;p giảm sự ph&aacute;t triển v&agrave; cải thiện c&aacute;c tế b&agrave;o melanin đậm m&agrave;u. Tr&ecirc;n thế giới c&oacute; rất nhiều h&atilde;ng&nbsp;<a href="https://www.eucerin.vn/van-de-cua-da/nam-da/duoc-my-pham-la-gi">dược mỹ phẩm</a>&nbsp;uy t&iacute;n sử dụng hoạt chất n&agrave;y.</p>\r\n\r\n<p>C&oacute; 3 lưu &yacute; khi sử dụng Hydroquinone để việc điều trị n&aacute;m đạt hiệu quả tối ưu:</p>\r\n\r\n<ul>\r\n	<li>- Sử dụng Hydroquinone c&oacute; nồng độ tr&ecirc;n 4% phải c&oacute; sự thăm kh&aacute;m v&agrave; k&ecirc; toa từ b&aacute;c sĩ. Nếu tự &yacute; sử dụng sẽ dễ g&acirc;y k&iacute;ch ứng nặng</li>\r\n	<li>- Chỉ n&ecirc;n d&ugrave;ng duy tr&igrave; Hydroquinone với nồng độ 2% trong v&ograve;ng 3 th&aacute;ng</li>\r\n	<li>- Thời gian b&aacute;n thải của Hydroquinone tr&ecirc;n da l&agrave; 28 ng&agrave;y. N&ecirc;n người d&ugrave;ng phải b&ocirc;i lại liều dặm sau 28 ng&agrave;y bởi t&iacute;nh ức chế tế b&agrave;o tyrosinase của Hydroquinone.</li>\r\n</ul>\r\n\r\n<p>Mặc d&ugrave; được đ&aacute;nh gi&aacute; l&agrave; một trong những c&aacute;ch trị n&aacute;m tốt nhất hiện nay, nhưng kh&ocirc;ng phải đơn thuần m&agrave; Hydroquinone bị cấm sử dụng ở một số nước. V&igrave; t&iacute;nh điều trị cao n&ecirc;n dược t&iacute;nh cũng tương đương. Nếu kh&ocirc;ng trang bị kiến thức đủ vững v&agrave;ng khi sử dụng Hydroquinone, sẽ dễ gặp phải c&aacute;c t&aacute;c dụng phụ kh&ocirc;ng mong muốn (dội ngược sắc tố, mất sắc tố, đen da, mất m&agrave;u da,...)<br />\r\nSau đ&acirc;y l&agrave; một số hoạt chất thay thế Hydroquinone c&oacute; thể sử dụng l&acirc;u d&agrave;i. Giải ph&aacute;p n&agrave;y sẽ an to&agrave;n hơn với những người mới tập t&agrave;nh sử dụng &ldquo;h&oacute;a chất&rdquo; trong điều trị da:</p>\r\n\r\n<ul>\r\n	<li>- Hexylresorcinol (0.5%-1%)</li>\r\n	<li>- Arrbutin (2%)</li>\r\n	<li>- Niacenamide (5%)</li>\r\n	<li>- Kojic Acid (10%)</li>\r\n	<li>- Tranexamic Acid (3%)&nbsp;&nbsp;</li>\r\n</ul>\r\n', 'DV03012409174185249070.mp4', 'DV03012409174185248197.png|', 0, 0, 0, 0),
