INSERT INTO `landing_page` (`rowid`, `lastmodify`, `crm`, `mshs`, `msdv`, `tendv`, `msdn`, `tieude`, `noidung`, `img_avt`, `img_donvi`, `lydo`, `goiy`) VALUES
	(1, '2024-01-23 15:32:34', 0, 'HS2112231326008966', 'DV2112231326006228', 'kbeauty-can-tho', 'kbeauty', 'Câu chuyện của chúng tôi', '<p>Spa, một từ ngắn gọn nhưng lại chứa đựng nhiều &yacute; nghĩa của sự chăm s&oacute;c bản th&acirc;n v&agrave; t&igrave;m kiếm sự c&acirc;n bằng giữa cảm x&uacute;c v&agrave; cơ thể. Xuất ph&aacute;t từ tiếng Latinh &quot;Salus Per Aquam,&quot; c&oacute; nghĩa l&agrave; &quot;sức khỏe qua nước,&quot; kh&aacute;i niệm spa đ&atilde; trải qua một h&agrave;nh tr&igrave;nh d&agrave;i để trở th&agrave;nh một phần quan trọng của lối sống hiện đại.</p>\r\n', '', '||', 'Chuyên môn và kinh nghiệm|Cam kết về chất lượng|Dịch vụ khách hàng xuất sắc', 'Vui lòng tư vấn|Yêu cầu tư vấn'),
	(2, '2024-01-14 17:18:48', 0, 'HS0912230850471728', 'DV0912230850474814', 'tpsoft-beauty', '0901090917', 'Câu chuyện của chúng tôi', '  Spa, một từ ngắn gọn nhưng lại chứa đựng nhiều ý nghĩa của sự chăm sóc bản thân và tìm kiếm sự cân bằng giữa cảm xúc và cơ thể. Xuất phát từ tiếng Latinh "Salus Per Aquam," có nghĩa là "sức khỏe qua nước," khái niệm spa đã trải qua một hành trình dài để trở thành một phần quan trọng của lối sống hiện đại.', '', '||', 'Chuyên môn và kinh nghiệm|Cam kết về chất lượng|Dịch vụ khách hàng xuất sắc', 'Yêu cầu tư vấn'),
	(3, '2024-01-14 16:57:49', 0, 'HS1001241015013211', 'DV1001241015016001', 'tham-my-vien-trung-son', '0931789199', 'Câu chuyện của chúng tôi', '<p>Ch&uacute;ng t&ocirc;i bắt đầu h&agrave;nh tr&igrave;nh của m&igrave;nh trong lĩnh vực l&agrave;m đẹp với mục ti&ecirc;u l&agrave;m thay đổi c&aacute;ch mọi người nh&igrave;n nhận v&agrave; trải nghiệm. Từ l&uacute;c th&agrave;nh lập, ch&uacute;ng t&ocirc;i lu&ocirc;n tập trung v&agrave;o việc mang lại cho kh&aacute;ch h&agrave;ng những trải nghiệm l&agrave;m đẹp tốt nhất v&agrave; sẽ l&agrave; nguồn cảm hứng để mọi người tự tin hơn.</p>\r\n', '', '||', 'Chuyên môn và kinh nghiệm|Cam kết về chất lượng|Dịch vụ khách hàng xuất sắc', 'Yêu cầu tư vấn|Vui lòng liên hệ');
