-- Dumping structure for procedure onebis.BC_CauTrucChiPhi
DELIMITER //
CREATE PROCEDURE `BC_CauTrucChiPhi`(
	IN `p_mshs` CHAR(50),
	IN `p_msdv` CHAR(50),
	IN `p_nam` INT
)
BEGIN
	DECLARE ChiLuong DOUBLE DEFAULT 0;
	DECLARE ChiDien DOUBLE DEFAULT 0;
	DECLARE ChiNha DOUBLE DEFAULT 0;
	DECLARE ChiMuaHang DOUBLE DEFAULT 0;
	DROP TABLE IF EXISTS tam;
	CREATE TEMPORARY TABLE tam(
		SELECT CONCAT('T', month(ngay))thang, SUM(abs(ifnull(sotien,0)))tongchiphi, 0 pttong, 0 luong, 0 ptluong, 0 dien, 0 ptdien, 0 nha, 0 ptnha, 0 muahang, 0 ptmuahang, 0 khac, 
		0 ptkhac, mshs, msdv FROM thuchi a
		WHERE mshs=p_mshs
		AND if(p_msdv='', 1 = 1, msdv=p_msdv)
		AND makhoanmuc 
			NOT IN (SELECT msloai FROM dmphanloai a 
			WHERE phanloai='khoanmuc' AND ADMIN = 1 AND dieukien2 IN ('TTU','CTU') 
			AND mshs=p_mshs
			AND if(p_msdv='', 1 = 1, msdv=p_msdv))
		AND year(ngay) = p_nam AND loaichungtu = 1 
		GROUP BY month(ngay) ORDER BY thang
);
		-- Sum Chi phí lương
		SET ChiLuong = (SELECT SUM(abs(ifnull(sotien,0))) FROM thuchi a
		WHERE mshs=p_mshs
		AND if(p_msdv='', 1 = 1, msdv=p_msdv)
		AND makhoanmuc 
			IN (SELECT msloai FROM dmphanloai a 
			WHERE phanloai='khoanmuc' AND ADMIN = 1 AND dieukien2 ='CLG' AND dieukien1='CHI'
			AND mshs=p_mshs
			AND if(p_msdv='', 1 = 1, msdv=p_msdv))
		AND year(ngay) = p_nam AND loaichungtu = 1);

		-- Sum Chi phí Điện
		SET ChiDien = (SELECT SUM(abs(ifnull(sotien,0))) FROM thuchi a
		WHERE mshs=p_mshs
		AND if(p_msdv='', 1 = 1, msdv=p_msdv)
		AND makhoanmuc 
			IN (SELECT msloai FROM dmphanloai a 
			WHERE phanloai='khoanmuc' AND ADMIN = 1 AND dieukien2 ='CTD' AND dieukien1='CHI'
			AND mshs=p_mshs
			AND if(p_msdv='', 1 = 1, msdv=p_msdv))
		AND year(ngay) = p_nam AND loaichungtu = 1);
		
		-- Sum Chi phí thuê nhà
		SET ChiNha = (SELECT SUM(abs(ifnull(sotien,0))) FROM thuchi a
		WHERE mshs=p_mshs
		AND if(p_msdv='', 1 = 1, msdv=p_msdv)
		AND makhoanmuc 
			IN (SELECT msloai FROM dmphanloai a 
			WHERE phanloai='khoanmuc' AND ADMIN = 1 AND dieukien2 ='CTN' AND dieukien1='CHI'
			AND mshs=p_mshs
			AND if(p_msdv='', 1 = 1, msdv=p_msdv))
		AND year(ngay) = p_nam AND loaichungtu = 1);
		
		-- Sum Chi phí trả nhà cung cấp
		SET ChiMuaHang = (SELECT SUM(abs(ifnull(sotien,0))) FROM thuchi a
		WHERE mshs=p_mshs
		AND if(p_msdv='', 1 = 1, msdv=p_msdv)
		AND makhoanmuc 
			IN (SELECT msloai FROM dmphanloai a 
			WHERE phanloai='khoanmuc' AND ADMIN = 1 AND dieukien2 ='CNCC' AND dieukien1='CHI'
			AND mshs=p_mshs
			AND if(p_msdv='', 1 = 1, msdv=p_msdv))
		AND year(ngay) = p_nam AND loaichungtu = 1);
		
				
		UPDATE tam SET pttong= ROUND((tongchiphi/(SELECT SUM(ifnull(tongcong,0))FROM banhang_header WHERE mshs=p_mshs AND if(p_msdv='', 1 = 1, msdv=p_msdv)))*100,0);
		
		UPDATE tam SET
		luong= ChiLuong, ptluong = ROUND((ChiLuong/tongchiphi)*100,0),
		dien= ChiDien, ptdien = ROUND((ChiDien/tongchiphi)*100,0),
		nha= ChiNha, ptnha = ROUND((ChiNha/tongchiphi)*100,0),
		muahang= ChiMuaHang, ptmuahang = ROUND((ChiMuaHang/tongchiphi)*100,0),
		khac = tongchiphi - luong - dien - nha - muahang,
		ptkhac= ROUND((khac/tongchiphi)*100,0)
		;
		
		SELECT thang, round(tongchiphi/1000000, 0 )tongchiphi, pttong, round(luong/1000000, 0 )luong, ptluong, round(dien/1000000, 0 )dien, ptdien, 
		round(nha/1000000, 0 )nha, ptnha, round(muahang/1000000, 0 )muahang, ptmuahang, round(khac/1000000, 0 )khac, ptkhac, mshs, msdv FROM tam ORDER BY thang;
END//
DELIMITER ;

-- Dumping structure for procedure onebis.BC_CongNo
DELIMITER //
CREATE PROCEDURE `BC_CongNo`(
	IN `p_mshs` CHAR(50),
	IN `p_msdv` CHAR(50),
	IN `p_tungay` DATE,
	IN `p_denngay` CHAR(50),
	IN `p_loaibc` CHAR(50)
)
BEGIN
	if(p_loaibc='TH_THU') then
		DROP TABLE IF EXISTS tam;
		CREATE TEMPORARY TABLE tam(
			SELECT concat(a.sdt_bandau,' | ', a.tenkh_bandau)ten, ifnull(b.dauky, 0) AS dauky, ifnull(c.tongcong,0) as phatsinh, 
				ifnull(c.dathanhtoan,0) as dathanhtoan, 
			   ifnull(c.notrongky, 0) AS notrongky, (ifnull(b.dauky,0) + ifnull(c.tongcong,0)  - ifnull(c.dathanhtoan, 0))  AS nocuoiky,
			   a.mshs, a.msdv
			FROM 
			   (SELECT sodienthoai as sdt_bandau, tenkh  AS tenkh_bandau, mshs, msdv FROM banhang_header
				WHERE mshs=p_mshs GROUP BY sodienthoai) a
			   LEFT JOIN
				   (SELECT  sodienthoai, sum(tongcong - dathanhtoan) AS dauky
					FROM banhang_header WHERE tongcong <> dathanhtoan
					AND mshs=p_mshs AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
					AND ngay < p_tungay AND trangthai = 1
					GROUP BY sodienthoai) b
				   ON a.sdt_bandau = b.sodienthoai
			   LEFT JOIN
				   (SELECT sodienthoai, tenkh, sum(ifnull(tongcong,0)) tongcong, SUM(ifnull(dathanhtoan,0)) dathanhtoan,
					SUM(ifnull(tongcong,0) - ifnull(dathanhtoan,0)) AS notrongky
				   FROM banhang_header
				   WHERE mshs= p_mshs AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
					AND trangthai = 1 AND ngay BETWEEN p_tungay AND p_denngay 
					GROUP BY sodienthoai) c
			   	ON a.sdt_bandau = c.sodienthoai
			ORDER BY msdv, nocuoiky DESC
		);
			SELECT * FROM tam WHERE dauky+phatsinh+dathanhtoan+notrongky+nocuoiky <> 0;
	END if;
	
	if(p_loaibc='TH_TRA') then 
		DROP TABLE IF EXISTS tam;
		CREATE TEMPORARY TABLE tam(
			SELECT concat(a.msncc_bandau,' | ', a.tenncc_bandau)ten, ifnull(b.dauky, 0) AS dauky, ifnull(c.tongcongvat,0) as phatsinh, 
				ifnull(c.dathanhtoan,0) as dathanhtoan, 
			   ifnull(c.notrongky, 0) AS notrongky, (ifnull(b.dauky,0) + ifnull(c.tongcongvat,0)  - ifnull(c.dathanhtoan, 0))  AS nocuoiky,
			   a.mshs, a.msdv
			FROM 
			   (SELECT msncc as msncc_bandau, tenncc AS tenncc_bandau, mshs, msdv FROM nhapkhoheader
				WHERE mshs= p_mshs GROUP BY msncc) a
			   LEFT JOIN
				   (SELECT  msncc, sum(tongcongvat - dathanhtoan) AS dauky
					FROM nhapkhoheader WHERE tongcongvat <> dathanhtoan
					AND mshs=p_mshs AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
					AND ngaygs < p_tungay AND loaiphieu <> '3'
					GROUP BY msncc) b
				   ON a.msncc_bandau = b.msncc
			   LEFT JOIN
				   (SELECT msncc, tenncc, sum(ifnull(tongcongvat,0)) tongcongvat, SUM(ifnull(dathanhtoan,0)) dathanhtoan,
					SUM(ifnull(tongcongvat,0) - ifnull(dathanhtoan,0)) AS notrongky
				   FROM nhapkhoheader
				   WHERE mshs= p_mshs  AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
					AND loaiphieu <> '3'
					AND ngaygs BETWEEN p_tungay AND p_denngay 
					GROUP BY msncc) c
			   	ON a.msncc_bandau = c.msncc
			ORDER BY msdv, nocuoiky DESC
		);
		SELECT * FROM tam WHERE dauky+phatsinh+dathanhtoan+notrongky+nocuoiky <> 0;
	END if;
	
	if(p_loaibc='CT_THU') then 		
	   SELECT DATE_FORMAT(ngay, '%d/%m/%Y')ngay, soct, concat(sodienthoai, ' | ', tenkh) AS ten, sodienthoai AS ms, socttc AS sothamchieu, tongcong, dathanhtoan,
		(ifnull(tongcong,0) - ifnull(dathanhtoan,0)) AS conno, mshs, msdv
	   FROM banhang_header
	   WHERE mshs= p_mshs AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
	   AND tongcong - dathanhtoan > 0
		AND trangthai = 1 AND ngay BETWEEN p_tungay AND p_denngay 
		ORDER BY msdv, ngay DESC;
	END if;
	
	if(p_loaibc='CT_TRA') then 		
	   SELECT DATE_FORMAT(ngaygs, '%d/%m/%Y') as ngay, soct, CONCAT(msncc,' | ', tenncc) AS ten, msncc AS ms, sophieuchi AS sothamchieu, tongcongvat as tongcong, dathanhtoan,
		(ifnull(tongcongvat,0) - ifnull(dathanhtoan,0)) AS conno, mshs, msdv, sohd
	   FROM nhapkhoheader
	   WHERE mshs= p_mshs AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
	   AND tongcongvat - dathanhtoan > 0
		AND loaiphieu <> '3' AND ngaygs BETWEEN p_tungay AND p_denngay 
		ORDER BY msdv, ngaygs DESC;
	END if;
	
END//
DELIMITER ;

-- Dumping structure for procedure onebis.BC_HoatDong
DELIMITER //
CREATE PROCEDURE `BC_HoatDong`(
	IN `p_mshs` CHAR(50),
	IN `p_msdv` CHAR(50),
	IN `p_tungay` DATE,
	IN `p_denngay` DATE,
	IN `p_tonghop` INT
)
BEGIN
	
	if(p_tonghop=1) then
		SELECT a.ngay, round(sum(a.doanhthu)/1000000,0)doanhthu, round(sum(a.chiphi)/1000000,0)chiphi, round(SUM(a.doanhthu - a.chiphi)/1000000,0)loinhuan, mshs, msdv
		FROM
			(
				SELECT DATE_FORMAT(ngay,'%d/%m/%Y')ngay, SUM(ifnull(tongcong,0))doanhthu, 0 chiphi, mshs, msdv FROM banhang_header
				WHERE mshs=p_mshs
				AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
				AND ngay BETWEEN p_tungay AND p_denngay AND trangthai = 1
				GROUP BY ngay
				UNION ALL
				SELECT DATE_FORMAT(ngay,'%d/%m/%Y')ngay, 0 doanhthu, SUM(abs(ifnull(sotien,0)))chiphi, mshs, msdv FROM thuchi
				WHERE mshs=p_mshs
				AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
				AND makhoanmuc NOT IN (SELECT msloai FROM dmphanloai WHERE phanloai='khoanmuc' AND ADMIN = 1 AND dieukien2 IN ('TTU','CTU') AND mshs = p_mshs AND if(p_msdv='', 1 = 1, msdv=p_msdv)) -- Thu, Chi tạm ứng
				AND ngay BETWEEN p_tungay AND p_denngay AND loaichungtu = 1 
				GROUP BY ngay ORDER BY ngay
			)a
		GROUP BY ngay;
	ELSE
				SELECT DATE_FORMAT(ngay,'%d/%m/%Y')ngay, soct AS sophieu, msdn AS nguoilap, SUM(ifnull(tongcong,0))doanhthu, 0 chiphi, mshs, msdv FROM banhang_header
				WHERE mshs=p_mshs
				AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
				AND ngay BETWEEN p_tungay AND p_denngay AND trangthai = 1
				GROUP BY soct
				UNION ALL
				SELECT DATE_FORMAT(ngay,'%d/%m/%Y')ngay, soct AS sophieu, msdn AS nguoilap, 0 doanhthu, SUM(abs(ifnull(sotien,0)))chiphi, mshs, msdv FROM thuchi
				WHERE mshs=p_mshs
				AND if(p_msdv='', 1 = 1, msdv=p_msdv)
				AND makhoanmuc NOT IN (SELECT msloai FROM dmphanloai WHERE phanloai='khoanmuc' AND ADMIN = 1 AND dieukien2 IN ('TTU','CTU') AND mshs = p_mshs AND if(p_msdv='', 1 = 1, msdv=p_msdv)) -- Thu, Chi tạm ứng
				AND ngay BETWEEN p_tungay AND p_denngay AND loaichungtu = 1 
				GROUP BY soct ORDER BY ngay;
	end if;
END//
