-- Dumping structure for procedure onebis.BC_HoatDong_Nam
DELIMITER //
CREATE PROCEDURE `BC_HoatDong_Nam`(
	IN `p_mshs` CHAR(50),
	IN `p_msdv` CHAR(50),
	IN `p_nam` INT
)
BEGIN
SELECT CONCAT('T',thang)thang, round(sum(doanhthu)/1000000,0)doanhthu, round(sum(chiphi)/1000000,0)chiphi, round(sum(doanhthu-chiphi)/1000000,0)loinhuan, mshs, msdv FROM 
		(
		SELECT month(ngay)thang, SUM(ifnull(tongcong,0))doanhthu, 0 chiphi, mshs, msdv FROM banhang_header
		WHERE mshs=p_mshs
		AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
		AND year(ngay) = p_nam AND trangthai = 1
		GROUP BY month(ngay)
		UNION ALL
		SELECT month(ngay)thang, 0 doanhthu, SUM(abs(ifnull(sotien,0)))chiphi, mshs, msdv FROM thuchi
		WHERE mshs=p_mshs
		AND if(p_msdv='', 1 = 1, msdv=p_msdv) 
		AND makhoanmuc NOT IN (SELECT msloai FROM dmphanloai WHERE phanloai='khoanmuc' AND ADMIN = 1 AND dieukien2 IN ('TTU','CTU') AND mshs = p_mshs AND if(p_msdv='', 1 = 1, msdv=p_msdv)) -- Thu, Chi tạm ứng
		AND year(ngay) = p_nam AND loaichungtu = 1 
