-- Dumping structure for procedure onebis.BC_ThuChi
DELIMITER //
CREATE PROCEDURE `BC_ThuChi`(
	IN `p_mshs` CHAR(50),
	IN `p_msdv` CHAR(50),
	IN `p_msdn` CHAR(50),
	IN `p_tungay` DATE,
	IN `p_denngay` CHAR(50),
	IN `p_makhoanmuc` CHAR(50),
	IN `p_nguoilap` CHAR(50)
)
BEGIN
	SELECT ''ngay, ''soct, ''hoten, ''noidung, ''tenloai, ''tennv, ''thu, ''chi, (SELECT ifnull(SUM(sotien),0)dauky FROM thuchi  
		WHERE mshs = p_mshs and if(p_msdv = '', 1 = 1, msdv = p_msdv)
		AND if(p_nguoilap = '', 1 = 1, msdn = p_nguoilap)
		AND ngay < p_tungay) as dauky, '1'loai,''msdv, ''lastmodify
      UNION ALL
      SELECT DATE_FORMAT(a.lastmodify, '%d/%m/%Y %H:%i ')ngay,a.soct, b.hoten, a.noidung, c.tenloai, a.tennv,
      case when  a.loaichungtu = 0 then a.sotien ELSE 0 END 'thu',
      case when a.loaichungtu = 1 then abs(a.sotien) ELSE 0 END 'chi', ''dauky,'0'loai, a.msdv, a.lastmodify
      FROM thuchi a
      INNER JOIN hosonhanvien b ON a.msdn = b.msdn
      INNER JOIN dmphanloai c ON a.makhoanmuc = c.msloai 
      WHERE  a.mshs=p_mshs and if(p_msdv = '', 1 = 1, a.msdv = p_msdv)
		AND a.ngay BETWEEN p_tungay AND p_denngay
		AND if(p_makhoanmuc = '', 1 = 1, a.makhoanmuc = p_makhoanmuc)
		AND if(p_nguoilap = '', 1 = 1, a.msdn = p_nguoilap)		 
      ORDER BY ngay, loai desc;
END//
