-- Dumping structure for procedure onebis.BC_TopHHDV
DELIMITER //
CREATE PROCEDURE `BC_TopHHDV`(
	IN `p_mshs` CHAR(50),
	IN `p_msdv` CHAR(50),
	IN `p_tungay` DATE,
	IN `p_denngay` DATE,
	IN `p_order` CHAR(50)
)
BEGIN
DROP TABLE IF EXISTS tam;
CREATE TEMPORARY TABLE tam(
SELECT a.mshh, a.tenhh, sum(sl)sl, SUM(gianhap)gianhap, SUM(doanhthu)doanhthu, SUM(loinhuan)laigop, mshs, msdv, b.khachhang, a.tenhh as dotuoi FROM
(
	SELECT msdv_lieutrinh AS mshh, tenlieutrinh AS  tenhh, 1 sl, 0 gianhap, 0 doanhthu, 0 loinhuan, 'DVLT' loai, mshs, msdv
	FROM banhang_line 
	WHERE msdv_lieutrinh <>'' AND mslieutrinh = 'CHA' and nhom_hh NOT IN ('LT', 'VC')
	AND ngay BETWEEN p_tungay AND p_denngay
	AND mshs = p_mshs AND if(p_msdv = '', 1 = 1, msdv = p_msdv)
	GROUP BY soct, msdv_lieutrinh
	UNION ALL
	SELECT msdv_lieutrinh AS mshh, tenlieutrinh AS  tenhh, 0 sl,
	SUM(gianhap*soluong)gianhap, 
	SUM(giathu*soluong)doanhthu, 
	SUM(giathu*soluong)-SUM(gianhap*soluong)loinhuan, 'CTLT' loai, mshs, msdv
	FROM banhang_line 
	WHERE msdv_lieutrinh <>'' and nhom_hh NOT IN ('LT', 'VC')
	AND ngay BETWEEN p_tungay AND p_denngay
	AND mshs = p_mshs AND if(p_msdv = '', 1 = 1, msdv = p_msdv) 
	GROUP BY soct,msdv_lieutrinh
	UNION ALL
	SELECT mshh, tenhh, sum(soluong)sl,
	SUM(gianhap*soluong)gianhap, 
	SUM(giathu*soluong)doanhthu, 
	SUM(giathu*soluong)-SUM(gianhap*soluong)loinhuan, 'HHDV' loai, mshs, msdv
	FROM banhang_line 
	WHERE msdv_lieutrinh = ''  AND nhom_hh NOT IN ('LT', 'VC')
	AND ngay BETWEEN p_tungay AND p_denngay
	AND mshs = p_mshs AND if(p_msdv = '', 1 = 1, msdv = p_msdv)
	GROUP BY mshh
	ORDER BY mshh	
)a
    -- JOIN THÊM CÂU TRUNG VIẾT
    LEFT JOIN
    (
    SELECT mshh,replace(GROUP_CONCAT(khachhang),',',' | ') khachhang FROM(
SELECT mshh, CONCAT(a.sodienthoai,' • ',tenkh, ' (' ,  SUM(1), ')' ) khachhang FROM `banhang_line` a INNER  JOIN banhang_header b on a.mshs = b.mshs and a.soct = b.soct
WHERE a.ngay BETWEEN p_tungay and p_denngay and b.mshs = p_mshs AND if(p_msdv = '', 1 = 1, b.msdv = p_msdv)  and msdv_lieutrinh <>'' AND mslieutrinh = 'CHA'  AND nhom_hh NOT IN ('LT', 'VC')
GROUP BY mshh, a.sodienthoai, tenkh, tenhh
UNION ALL 
SELECT mshh, CONCAT(a.sodienthoai,' • ',tenkh, ' (' ,  SUM(soluong), ')' ) khachhang FROM `banhang_line` a INNER  JOIN banhang_header b on a.mshs = b.mshs and a.soct = b.soct
WHERE a.ngay BETWEEN p_tungay and p_denngay and b.mshs = p_mshs AND if(p_msdv = '', 1 = 1, b.msdv = p_msdv)  and msdv_lieutrinh = ''  AND nhom_hh NOT IN ('LT', 'VC')
GROUP BY mshh, a.sodienthoai, tenkh, tenhh
) A
GROUP BY mshh
    ) b
    ON a.mshh = b.mshh
    
GROUP BY a.mshh
);
	-- Cập nhật độ tuổi
	UPDATE tam SET dotuoi ='';
	UPDATE tam a INNER JOIN 
	(
		SELECT a.mshh, a.mshs,
		CONCAT(min(a.dotuoi), ' - ', max(a.dotuoi))dotuoi
		FROM banhang_line a  
		WHERE a.nhom_hh NOT IN ('LT', 'VC')
		AND a.ngay BETWEEN p_tungay AND p_denngay
		AND if(p_msdv = '', 1 = 1, a.msdv = p_msdv)
		AND a.mshs = p_mshs
		GROUP BY mshh
	) b
	ON a.mshh = b.mshh AND a.mshs = b.mshs
	SET a.dotuoi = b.dotuoi;
	
	
	if(p_order='' || p_order='doanhthu') then
		SELECT * FROM tam 
		ORDER BY doanhthu DESC ;
	end if;
	if(p_order='sl') then
			SELECT * FROM tam 
			ORDER BY sl DESC ;
	end if;
	if(p_order='laigop') then
			SELECT * FROM tam  
			ORDER BY laigop DESC ;
	end if;
END//
DELIMITER ;

