	AND a.ngay BETWEEN p_tungay AND p_denngay
	AND a.mshs = p_mshs AND if(p_msdv = '', 1 = 1, a.msdv = p_msdv)
	GROUP BY a.soct, b.mskh
	UNION ALL
	SELECT b.mskh, b.tenkh, sum(soluong)sl,
	SUM(gianhap*soluong)gianhap, 
	SUM(giathu*soluong)doanhthu, 
