CREATE PROCEDURE `CheckDelete_BanHang`(
	IN `_msdv` CHAR(50) CHARSET utf8mb3,
	IN `_msdn` CHAR(50) CHARSET utf8mb3,
	IN `_soct` CHAR(50) CHARSET utf8mb3,
	IN `_idchidinh` CHAR(50) CHARSET utf32
)
BEGIN
	DECLARE ThongBao NVARCHAR(200) DEFAULT '';
	DECLARE DaThu_ DOUBLE DEFAULT 0;
	DECLARE DaXoa DOUBLE DEFAULT 0;
		
	if (_idchidinh ='NO') then -- Theo số chứng từ
		SELECT COUNT(rowid) FROM banhang_line WHERE soct=_soct AND (dathu > 0 OR thuchien = 1) AND msdv = _msdv INTO DaThu_;
			
		if(DaThu_>0) then
			SET ThongBao='Phiếu Đã Thu tiền hoặc Dịch vụ Đã Thực Hiện';
			SET DaXoa = 0;
		ELSE
			-- Insert Nhật ký xóa
			DELETE FROM banhang_header WHERE soct=_soct AND msdv = _msdv;
			DELETE FROM banhang_line WHERE soct=_soct AND msdv = _msdv;
			DELETE FROM nhatky_thuchien WHERE soct=_soct AND msdv = _msdv;
			SET ThongBao='Đã xóa';
			SET DaXoa = 1;
		END if;
	ELSE -- Theo MSHH
		SELECT COUNT(rowid) FROM banhang_line WHERE soct=_soct AND idchidinh = _idchidinh AND (thuchien > 0 or dathu=1) AND msdv = _msdv INTO DaThu_;
		if(DaThu_>0) then
			SET ThongBao='Phiếu Đã Thu tiền hoặc Dịch vụ Đã Thực Hiện';
			SET DaXoa = 0;
		ELSE 
			DELETE FROM nhatky_thuchien WHERE rowidtc IN (SELECT rowid FROM banhang_line WHERE idchidinh = _idchidinh and msdv = _msdv) and msdv = _msdv;
			DELETE FROM banhang_line WHERE soct=_soct AND msdv = _msdv AND idchidinh = _idchidinh;
			SET ThongBao='Đã xóa';
			SET DaXoa = 1;
		END if;
	END if;
   SELECT ThongBao, DaXoa;
END//
DELIMITER ;

