CREATE PROCEDURE `LayTonKhoBaoCao`(
	IN `_mahs` CHAR(30) CHARSET utf8mb3,
	IN `_macn` CHAR(30) CHARSET utf8mb3,
	IN `_tungay` DATE,
	IN `_denngay` DATE,
	IN `_loai` CHAR(2) CHARSET utf8mb3
)
    NO SQL
BEGIN

  CASE _loai
		WHEN 'CN' THEN
        
DROP TABLE IF EXISTS tam;
CREATE TEMPORARY TABLE tam(
SELECT mshs, msdv,mshh,solo,handung,gianhapcothue,TonDau, TongNhap, TongXuat,  TonCuoi, gianhapcothue GTXuat
FROM(
SELECT mshs, msdv,mshh,solo,handung,gianhapcothue,Ton TonDau, Ton TongNhap, Ton TongXuat, Ton TonCuoi  FROM 
(SELECT mshs, msdv,mshh,solo,handung,ROUND(gianhapcothue) AS gianhapcothue ,SUM(soluong)Ton 
 FROM nhapkholine WHERE msdv=_macn  and tam ='0'  GROUP BY mshh,solo,handung,ROUND(gianhapcothue), msdv, mshs
)a
GROUP BY mshh,solo,handung,ROUND(gianhapcothue)
UNION
SELECT mshs, msdv,mshh,solo,handung,gianhapcothue,Ton TonDau, Ton TongNhap, Ton TongXuat, Ton TonCuoi  FROM 
(SELECT mshs, msdv,mshh,solo,handung,ROUND(gianhapvat) AS gianhapcothue ,SUM(soluong)Ton 
 FROM xuatkho_line WHERE msdv=_macn and tam <>'1' GROUP BY mshh,solo,handung,ROUND(gianhapvat), msdv, mshs
)b
GROUP BY mshh,solo,handung,ROUND(gianhapcothue)) a
GROUP BY mshh,solo,handung,ROUND(gianhapcothue)
);

UPDATE tam SET TonDau = 0, tongnhap = 0, TongXuat = 0, TonCuoi = 0, GTXuat= 0 ;

  -- TON DAU 
UPDATE tam as t inner join
(
SELECT a.msdv,a.mshh,a.solo,a.handung,ROUND(a.gianhapcothue) as gianhapcothue,SUM(a.Ton)Ton  FROM 
      (SELECT n.msdv,n.mshh,n.solo,n.handung,  ROUND(n.gianhapcothue) as gianhapcothue,SUM(n.soluong)Ton 
