CREATE PROCEDURE `Post_DatHang_Line`(
	IN `_mshs` CHAR(50) CHARSET utf8mb3,
	IN `_msdv` CHAR(50) CHARSET utf8mb3,
	IN `_msdn` CHAR(50) CHARSET utf8mb3,
	IN `_dienthoai` CHAR(50) CHARSET utf8mb3,
	IN `_soct` CHAR(50) CHARSET utf8mb3,
	IN `_idchidinh` CHAR(50) CHARSET utf8mb3,
	IN `_hhdv` VARCHAR(50) CHARSET utf8mb3,
	IN `_colieutrinh` INT,
	IN `_nhom_kh` CHAR(50) CHARSET utf8mb3,
	IN `_msctkm` CHAR(50) CHARSET utf8mb3,
	IN `_ptgiam` DOUBLE,
	IN `_mshh` CHAR(50) CHARSET utf8mb3
)
BEGIN
	DECLARE CheckMoTaDV DOUBLE DEFAULT 0; 
	
	
	DECLARE SoLuongMoTa_TheoHH DOUBLE DEFAULT 0; 
	DECLARE SoLuongMoTa DOUBLE DEFAULT 0;
	DECLARE MSHHMoTa  CHAR(60);
	DECLARE DonGiaMoTa DOUBLE DEFAULT 0;
	DECLARE DinhLuongMoTa FLOAT  DEFAULT 0;
	DECLARE SoVongLap INT DEFAULT 0;
	
	DECLARE Check_MSHH_LieuTrinh  CHAR(60);
	
	SELECT IFNULL((SELECT lieutrinh FROM hosodichvu WHERE msdichvu = _mshh AND msdv = _msdv LIMIT 1), '0') INTO Check_MSHH_LieuTrinh;
	
	if(Check_MSHH_LieuTrinh = 2) then
		SET _hhdv = 'GDV';
	END if;	
	
	CASE _hhdv
	WHEN 'DV' then
		if(_colieutrinh=1) then -- 1. Post Dịch vụ có liệu trình
			-- 1.1. Post dịch vụ liệu trình cha
			nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, msdv_lieutrinh)
			SELECT NOW(), _dienthoai, 0, _msdn, _mshs, _msdv, CURDATE(), 1, CURDATE(), _soct, _idchidinh, _mshh, tendichvu, 'CHA', tendichvu, _nhom_kh, 
			'DVLT', 'DVLT', 'Lần', 1, 0, 0, '', 0, 0, 0, 0, 0, _mshh FROM hosodichvu
			WHERE msdichvu = _mshh AND lieutrinh = 1 AND msdv=_msdv;
			-- 1.2. Post liệu trình
			nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, msdv_lieutrinh)
			SELECT NOW(), _dienthoai, 0, _msdn, _mshs, _msdv, DATE_ADD(CURDATE(), INTERVAL songay DAY),thutu , concat(date(DATE_ADD(CURDATE(), INTERVAL songay DAY)), ' 09:00:00'), _soct, _idchidinh, mslieutrinh, tenlieutrinh, msdichvu, tenlieutrinh, _nhom_kh, 
			'LT','LT', thutu, 1, 0, 0, '', '', 0, 0, 0, 0, _mshh FROM hosolieutrinh 
			WHERE msdichvu = _mshh AND msdv=_msdv ORDER BY thutu;	
			-- 1.3.Post mô tả liệu trình
			-- 1.3.1.Post dịch vụ 
			nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, songay_bh, msdv_lieutrinh, soluong_xuat)
			SELECT NOW(), _dienthoai, c.pttichluy, c.ptthuchien, _msdn, _mshs, _msdv, DATE_ADD(CURDATE(), INTERVAL b.songay DAY), b.thutu, concat(date(DATE_ADD(CURDATE(), INTERVAL b.songay DAY)), ' 09:00:00'), _soct, _idchidinh, a.mshh, a.tenhh, b.mslieutrinh, b.tenlieutrinh, _nhom_kh, 
			'DV', c.nhom_dichvu, 'Lần', a.soluong, c.giavon, a.dongia, _msctkm, _ptgiam, a.dongia - ROUND((a.dongia*_ptgiam/100),0), c.thuesuat, (a.dongia - ROUND((a.dongia*_ptgiam/100),0))+ ROUND((a.dongia - (a.dongia*_ptgiam/100)) *c.thuesuat/100,0), 0, c.songay_bh, _mshh, if(a.dinhluong=0,a.soluong,a.dinhluong) FROM motadichvu a
			INNER JOIN hosolieutrinh b ON a.mslieutrinh = b.mslieutrinh and a.msdv = b.msdv 
			INNER JOIN hosodichvu c ON a.mshh = c.msdichvu and a.msdv = b.msdv 
			WHERE b.msdichvu = _mshh AND c.trangthai = 0 AND a.msdv=_msdv;
			-- 1.3.2.Post hàng hóa
			nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, songay_bh, msdv_lieutrinh, soluong_xuat)
			SELECT NOW(), _dienthoai, b.pttichluy, b.ptthuchien, _msdn, _mshs, _msdv, DATE_ADD(CURDATE(), INTERVAL c.songay DAY), c.thutu, concat(date(DATE_ADD(CURDATE(), INTERVAL songay DAY)), ' 09:00:00'), _soct, _idchidinh, a.mshh, a.tenhh, a.mslieutrinh, c.tenlieutrinh, _nhom_kh, 
			'HH', b.loai_hh, b.dvt, a.soluong, b.gianhap, a.dongia, _msctkm, _ptgiam, a.dongia - ROUND((a.dongia*_ptgiam/100),0), b.thuesuat, (a.dongia - ROUND((a.dongia*_ptgiam/100),0))+ ROUND((a.dongia - (a.dongia*_ptgiam/100)) *b.thuesuat/100,0), 0, b.songay_bh, _mshh, if(a.dinhluong=0,a.soluong,a.dinhluong) FROM motadichvu a
			INNER JOIN hosohanghoa b ON a.mshh = b.mshh and a.msdv = b.msdv 
			INNER JOIN hosolieutrinh c ON a.mslieutrinh = c.mslieutrinh and a.msdv = b.msdv 
			WHERE a.msdichvu = _mshh AND b.trangthai = 0 AND a.msdv=_msdv;
	 	
		ELSE  -- 2. Post Dịch vụ không có liệu trình
			SET CheckMoTaDV = (SELECT COUNT(rowid) FROM motadichvu WHERE msdichvu = _mshh AND msdv=_msdv);
			SET CheckMoTaDV = CheckMoTaDV + (SELECT COUNT(a.rowid) FROM motadichvu a INNER JOIN hosodichvu b	ON a.msdv = b.msdv AND a.mshh = b.msdichvu WHERE a.msdichvu = _mshh AND a.msdv=_msdv AND b.trangthai = 0);
			SET CheckMoTaDV = CheckMoTaDV + (SELECT COUNT(a.rowid) FROM motadichvu a INNER JOIN hosohanghoa b	ON a.msdv = b.msdv AND a.mshh = b.mshh WHERE a.msdichvu = _mshh AND a.msdv=_msdv AND b.trangthai = 0);
			
			if(CheckMoTaDV = 0) then -- 2.1. Post dịch vụ không có liệu trình, không có mô tả dịch vụ						
				nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, songay_bh)
				SELECT NOW(), _dienthoai, pttichluy, ptthuchien, _msdn, _mshs, _msdv, CURDATE(), 1, NOW(), _soct, _idchidinh, _mshh, tendichvu, '', '', _nhom_kh, 
				'DV', nhom_dichvu, 'Lần', 1, giavon, sotien, _msctkm, _ptgiam, sotien - ROUND((sotien*_ptgiam/100),0), thuesuat, (sotien - ROUND((sotien*_ptgiam/100),0))+ ROUND((sotien - (sotien*_ptgiam/100)) *thuesuat/100,0), 0, songay_bh FROM hosodichvu
				WHERE msdichvu = _mshh AND lieutrinh = 0 AND msdv=_msdv; 
			ELSE -- 2.2. Post dịch vụ không có liệu trình, có mô tả dịch vụ
				nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, songay_bh)
				SELECT NOW(), _dienthoai, 0, 0, _msdn, _mshs, _msdv, CURDATE(), 1, NOW(), _soct, _idchidinh, _mshh, tendichvu, '', '', _nhom_kh, 
				'LT', nhom_dichvu, 'Lần', 1, 0, 0, '', 0, 0, 0, 0, 0, 0 FROM hosodichvu
				WHERE msdichvu = _mshh AND lieutrinh = 0 AND msdv=_msdv; 
				-- 2.2.1.Post dịch vụ
				nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, songay_bh, soluong_xuat)
				SELECT NOW(), _dienthoai, c.pttichluy, c.ptthuchien, _msdn, _mshs, _msdv, CURDATE(),1, NOW(),_soct, _idchidinh, a.mshh, a.tenhh, a.mslieutrinh, 'KLT', _nhom_kh, 
				'DV', c.nhom_dichvu, 'Lần', a.soluong, c.giavon, a.dongia, _msctkm, _ptgiam, a.dongia - ROUND((a.dongia*_ptgiam/100),0), c.thuesuat, (a.dongia - ROUND((a.dongia*_ptgiam/100),0))+ ROUND((a.dongia - (a.dongia*_ptgiam/100)) *c.thuesuat/100,0), 0, c.songay_bh, if(a.dinhluong=0,a.soluong,a.dinhluong) FROM motadichvu a
				INNER JOIN hosodichvu c ON a.mshh = c.msdichvu and a.msdv = c.msdv 
				WHERE a.msdichvu = _mshh AND c.trangthai = 0 AND a.msdv=_msdv;
				-- 2.2.2.Post hàng hóa
				nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, songay_bh, soluong_xuat)
				SELECT NOW(), _dienthoai, c.pttichluy, c.ptthuchien, _msdn, _mshs, _msdv, CURDATE(),1, NOW(),_soct, _idchidinh, a.mshh, a.tenhh, '', '', _nhom_kh, 
				'HH', c.loai_hh, 'Lần', a.soluong, c.gianhap, a.dongia, _msctkm, _ptgiam, a.dongia - ROUND((a.dongia*_ptgiam/100),0), c.thuesuat, (a.dongia - ROUND((a.dongia*_ptgiam/100),0))+ ROUND((a.dongia - (a.dongia*_ptgiam/100)) *c.thuesuat/100,0), 0, c.songay_bh, if(a.dinhluong=0,a.soluong,a.dinhluong) FROM motadichvu a
				INNER JOIN hosohanghoa c ON a.mshh = c.mshh and a.msdv = c.msdv 
				WHERE a.msdichvu = _mshh AND c.trangthai = 0 AND a.msdv=_msdv;
			END if;		
		END if;	
	WHEN 'HH' then
				nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, songay_bh)
				SELECT NOW(), _dienthoai, a.pttichluy, a.ptthuchien, _msdn, _mshs, _msdv, CURDATE(),1, NOW(),_soct, _idchidinh, a.mshh, a.tenhh, '', '', _nhom_kh, 
				'HH', a.loai_hh, 'Lần', 1, a.gianhap, a.giaban, _msctkm, _ptgiam, a.giaban - ROUND((a.giaban*_ptgiam/100),0), a.thuesuat, (a.giaban - ROUND((a.giaban*_ptgiam/100),0))+ ROUND((a.giaban - (a.giaban*_ptgiam/100)) *a.thuesuat/100,0), 0, a.songay_bh FROM hosohanghoa a
				WHERE a.mshh = _mshh AND a.trangthai = 0 AND a.msdv=_msdv;
	WHEN 'GDV' then
	
		-- INSERT CHA
		msdv_lieutrinh, mslieutrinh, tenlieutrinh, nhom_kh, nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, 
		thuesuat, giathuvat, thuchien, songay_bh)
		SELECT NOW(), _dienthoai, a.pttichluy, a.ptthuchien, _msdn, _mshs, _msdv, CURDATE(),1, NOW(),_soct, _idchidinh, a.msdichvu, a.tendichvu, 
		_mshh, 'CHA', a.tendichvu, _nhom_kh, 'GDV', a.nhom_dichvu, 'Lần', 1, '0', '0', '', '0', '0', '0', '0', 0, '0' FROM hosodichvu a
		WHERE a.msdichvu = _mshh AND a.trangthai = 0 AND a.msdv=_msdv;
		
		--	INSERT CON			
		SELECT  COUNT(rowid) INTO SoLuongMoTa_TheoHH from  motadichvu where msdichvu=_mshh AND msdv = _msdv;
		   WHILE (SoLuongMoTa_TheoHH > SoVongLap) DO
		   	SELECT mshh INTO MSHHMoTa from  motadichvu WHERE  msdichvu=_mshh AND msdv = _msdv ORDER BY mshh LIMIT SoVongLap, 1;
				SELECT dongia INTO DonGiaMoTa from  motadichvu where  msdichvu=_mshh AND msdv = _msdv ORDER BY mshh LIMIT SoVongLap, 1;
				SELECT soluong INTO SoLuongMoTa from  motadichvu where  msdichvu=_mshh AND msdv = _msdv ORDER BY mshh LIMIT SoVongLap, 1;
				SELECT dinhluong INTO DinhLuongMoTa from  motadichvu where  msdichvu=_mshh AND msdv = _msdv ORDER BY mshh LIMIT SoVongLap, 1;
				
				WHILE (SoLuongMoTa > 0 ) DO
				
					msdv_lieutrinh, mslieutrinh, tenlieutrinh, nhom_kh, nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, 
					songay_bh, soluong_xuat)
					SELECT NOW(), _dienthoai, a.pttichluy, a.ptthuchien, _msdn, _mshs, _msdv, CURDATE(),1, NOW(),_soct, _idchidinh, a.mshh, a.tenhh, 
					_mshh, 'CON', a.tenhh, _nhom_kh, 'HH', a.loai_hh, 'Lần', 1, a.gianhap, DonGiaMoTa, _msctkm, _ptgiam, DonGiaMoTa - ROUND((DonGiaMoTa * _ptgiam/100),0), 
					a.thuesuat, (DonGiaMoTa - ROUND((DonGiaMoTa * _ptgiam/100),0))+ ROUND((DonGiaMoTa - (DonGiaMoTa * _ptgiam/100)) *a.thuesuat/100,0), 0, a.songay_bh, 
					'1' FROM hosohanghoa a
					WHERE a.mshh = MSHHMoTa AND a.trangthai = 0 AND a.msdv=_msdv;
									
					msdv_lieutrinh, mslieutrinh, tenlieutrinh, nhom_kh, nhom_hh, loai_hh, dvt, soluong, gianhap, giaban, msctkm, ptgiam, giathu, thuesuat, giathuvat, thuchien, 
					songay_bh, soluong_xuat)
					SELECT NOW(), _dienthoai, c.pttichluy, c.ptthuchien, _msdn, _mshs, _msdv, CURDATE(),1, NOW(),_soct, _idchidinh, c.msdichvu, c.tendichvu, 
					_mshh, 'CON', c.tendichvu, _nhom_kh, 'DV', c.nhom_dichvu, 'Lần', '1', c.giavon, DonGiaMoTa, _msctkm, _ptgiam, DonGiaMoTa - ROUND((DonGiaMoTa * _ptgiam/100),0), 
					c.thuesuat, (DonGiaMoTa - ROUND((DonGiaMoTa * _ptgiam/100),0))+ ROUND((DonGiaMoTa - (DonGiaMoTa * _ptgiam/100)) *c.thuesuat/100,0), 0, c.songay_bh, '1'
					FROM hosodichvu c 
					WHERE c.msdichvu = MSHHMoTa AND c.trangthai = 0 AND c.msdv=_msdv;

				SET SoLuongMoTa = SoLuongMoTa - 1;
				END WHILE;
							
				SET SoVongLap = SoVongLap + 1;

		   END WHILE;
	END CASE;
END//
DELIMITER ;

-- Dumping structure for procedure onebis.Post_NhatKyThucHien
DELIMITER //
CREATE PROCEDURE `Post_NhatKyThucHien`(
	IN `p_mshs` CHAR(50) CHARSET utf8mb3,
	IN `p_msdv` CHAR(50) CHARSET utf8mb3,
	IN `p_soct` CHAR(50) CHARSET utf8mb3,
	IN `p_rowidtc` CHAR(50) CHARSET utf8mb3,
	IN `p_msnv` CHAR(50) CHARSET utf8mb3,
	IN `p_mslieutrinh` CHAR(50)
)
BEGIN	  
	-- Cập nhật trang thái thực hiện
	UPDATE banhang_line SET thuchien=2 WHERE rowid=p_rowidtc AND mshs=p_mshs AND msdv=p_msdv;
	
	if(p_mslieutrinh <>'')then
		UPDATE banhang_line SET thuchien = 2 WHERE mshh=p_mslieutrinh AND nhom_hh='LT' AND soct=p_soct AND mshs=p_mshs AND msdv=p_msdv;
	END if;
	
	-- Post người nhấn thực hiện	
	SELECT p_rowidtc, NOW(),p_mshs, p_msdv, p_soct, p_msnv, b.hoten, ifnull(c.dieukien1,'0')phatram, b.loai_nv, (a.giathu*a.soluong), ((a.giathu*a.soluong) * a.ptthuchien)/100  FROM banhang_line a
	INNER JOIN hosonhanvien b ON a.mshs = b.mshs AND b.msdn=p_msnv
	LEFT JOIN dmphanloai c ON b.loai_nv = c.msloai AND a.msdv = c.msdv
	WHERE a.rowid= p_rowidtc and c.phanloai='loai_nv'
	AND a.msdv=p_msdv;
	
	-- Post người tư vấn
	SELECT p_rowidtc, NOW(), NOW(),p_mshs, p_msdv, p_soct, a.msdn, b.hoten, ifnull(c.dieukien1,'0')phatram, b.loai_nv, (a.giathu*a.soluong),
	((a.giathu*a.soluong) * a.ptthuchien)/100, 'CD'  FROM banhang_line a
	INNER JOIN hosonhanvien b ON a.msdn = b.msdn AND a.mshs = b.mshs
	LEFT JOIN dmphanloai c ON b.loai_nv = c.msloai AND a.msdv = c.msdv
	WHERE a.rowid= p_rowidtc and c.phanloai='loai_nv'
	AND a.msdv=p_msdv AND a.msdn NOT IN (SELECT msnv FROM nhatky_thuchien WHERE msdv=p_msdv AND rowidtc = p_rowidtc) ;
END//
DELIMITER ;

-- Dumping structure for procedure onebis.ShowItems
DELIMITER //
CREATE PROCEDURE `ShowItems`(
	IN `_mshs` CHAR(50) CHARSET utf8mb3,
	IN `_msdv` CHAR(50) CHARSET utf8mb3,
	IN `_dienthoai` CHAR(50) CHARSET utf8mb3,
	IN `_nhom` CHAR(50) CHARSET utf8mb3,
	IN `_lieutrinh` INT,
	IN `_loai` CHAR(50) CHARSET utf8mb3,
	IN `_keyword` CHAR(50) CHARSET utf8mb3
)
BEGIN
	DECLARE PTGiamTV DOUBLE DEFAULT 0;
	DECLARE NhomKH CHAR(20) DEFAULT '';

	SELECT IFNULL((SELECT ifnull(b.phantramgiam,0) FROM hosokhachhang a LEFT JOIN nhom_khachhang b ON a.mshs=b.mshs AND a.nhom_kh=b.msnhom
        WHERE a.mshs=_mshs AND a.sodienthoai = _dienthoai),0) INTO PTGiamTV;
  	SELECT IFNULL((SELECT ifnull(nhom_kh,'') FROM hosokhachhang WHERE mshs=_mshs AND sodienthoai = _dienthoai),'') INTO NhomKH;  
	
	  CASE _nhom
		WHEN 'DV' THEN	-- Liệu trình
			SELECT sotien AS giaban, 
			if(PTGiamTV>ifnull(b.ptgiam,0),NhomKH,ifnull(msctkm,''))msctkm,
			if(PTGiamTV>ifnull(b.ptgiam,0),PTGiamTV,ifnull(b.ptgiam,0))ptgiam,
			if(PTGiamTV>ifnull(b.ptgiam,0),a.sotien - ROUND((a.sotien*PTGiamTV/100),0),a.sotien - ROUND((a.sotien*ifnull(b.ptgiam,0)/100),0))giathu,
			a.thuesuat,
			ROUND((if(PTGiamTV>ifnull(b.ptgiam,0),a.sotien - ROUND((a.sotien*PTGiamTV/100),0),a.sotien - ROUND((a.sotien*ifnull(b.ptgiam,0)/100),0)) + 
			(if(PTGiamTV>ifnull(b.ptgiam,0),a.sotien - ROUND((a.sotien*PTGiamTV/100),0),a.sotien - ROUND((a.sotien*ifnull(b.ptgiam,0)/100),0))
			* a.thuesuat)/100),0) giathuvat,
			a.msdichvu as maso, a.tendichvu as ten, a.pttichluy, PTGiamTV, ifnull(b.ptgiam,0) ptgiamctkm, path_video, path_image, mota, a.lieutrinh, IFNULL(a.ptthuchien,0)ptthuchien
			FROM hosodichvu a
			LEFT JOIN ctkm b on a.msdichvu = b.mshh AND a.msdv=b.msdv AND CURRENT_DATE BETWEEN IFNULL(b.tungay,CURRENT_DATE) AND IFNULL(b.denngay, CURRENT_DATE) AND b.khoa = 0
			WHERE a.trangthai = 0 AND if(_lieutrinh = 1, a.lieutrinh = 1, a.lieutrinh <> 1) AND a.msdv=_msdv
			AND IF(_loai<>'',a.nhom_dichvu=_loai,'1=1') 
			AND IF(_keyword<>'',a.tendichvu LIKE CONCAT('%',_keyword,'%'),'1=1')
			ORDER BY a.lieutrinh, a.tendichvu;
		
		WHEN 'HH' THEN	-- Hàng hóa
		SELECT giaban, 
			if(PTGiamTV>ifnull(b.ptgiam,0),NhomKH,ifnull(msctkm,''))msctkm,
			if(PTGiamTV>ifnull(b.ptgiam,0),PTGiamTV,ifnull(b.ptgiam,0))ptgiam,
			if(PTGiamTV>ifnull(b.ptgiam,0),a.giaban - ROUND((a.giaban*PTGiamTV/100),0),a.giaban - ROUND((a.giaban*ifnull(b.ptgiam,0)/100),0))giathu,
			a.thuesuat,
			ROUND((if(PTGiamTV>ifnull(b.ptgiam,0),a.giaban - ROUND((a.giaban*PTGiamTV/100),0),a.giaban - ROUND((a.giaban*ifnull(b.ptgiam,0)/100),0)) + 
			(if(PTGiamTV>ifnull(b.ptgiam,0),a.giaban - ROUND((a.giaban*PTGiamTV/100),0),a.giaban - ROUND((a.giaban*ifnull(b.ptgiam,0)/100),0))
			* a.thuesuat)/100),0) giathuvat,
			a.mshh as maso, a.tenhh as ten, a.pttichluy, PTGiamTV, ifnull(b.ptgiam,0) ptgiamctkm, '' as path_video, path_image, mota, IFNULL(a.ptthuchien,0)ptthuchien
			FROM hosohanghoa a
			LEFT JOIN ctkm b on a.mshh = b.mshh AND a.msdv=b.msdv AND CURRENT_DATE BETWEEN IFNULL(b.tungay,CURRENT_DATE) AND IFNULL(b.denngay, CURRENT_DATE) AND b.khoa = 0
			WHERE a.trangthai = 0 AND a.msdv=_msdv 
			AND IF(_loai<>'',a.loai_hh=_loai,'1=1') 
			AND IF(_keyword<>'',a.tenhh LIKE CONCAT('%',_keyword,'%') OR a.mavach LIKE CONCAT('%',_keyword,'%'),'1=1')
			ORDER BY a.tenhh;
  
	END CASE;

END//
DELIMITER ;

-- Dumping structure for procedure onebis.Show_CRM
DELIMITER //
CREATE PROCEDURE `Show_CRM`(
	IN `p_msdv` CHAR(50),
	IN `p_msdn` CHAR(50)
)
BEGIN
	DECLARE MSTrangThai CHAR(30) DEFAULT '';
	SET MSTrangThai = (SELECT IFNULL(( SELECT msloai FROM dmphanloai WHERE msdv=p_msdv AND phanloai='ttcrm' AND dieukien2='CLH' LIMIT 1),''));	
	-- Lấy bên yêu cầu tư vấn Lading Page
	SELECT rowid, CONCAT(DATE_FORMAT(lastmodify, '%d%m%y%H%i%s'), LPAD(rowid, 4, 0)), mshs, msdv, p_msdn, NOW(), lastmodify, date(lastmodify), nguon, MSTrangThai,
	 sodienthoai, hoten, noidung FROM yeucautuvan
	WHERE crm= 0 AND msdv=p_msdv; 
	
	UPDATE yeucautuvan SET crm= 1 where msdv=p_msdv AND crm = 0;
	
	-- Lấy khách hàng đánh giá không hài lòng	
	dienthoai, hoten, noidung)
	SELECT a.rowid, a.soct, a.mshs, a.msdv, p_msdn, NOW(), a.lastmodify, date(a.lastmodify),'KDG', 'KHDG', MSTrangThai,
	a.sodienthoai, b.tenkh, CONCAT(a.mshh,' • ', a.noidung)
	FROM nhatky_tuvan a
	INNER JOIN banhang_header b ON a.soct = b.soct AND a.msdv= b.msdv
	WHERE a.msdv= p_msdv and a.loai='DG' AND LEFT(a.mshh,1)<3 AND a.crm = 0;
	
	UPDATE nhatky_tuvan SET crm= 1 where msdv=p_msdv AND crm = 0;		
END//
DELIMITER ;

