DELIMITER //
CREATE PROCEDURE `Show_Dashboard`(
	IN `p_mshs` VARCHAR(50),
	IN `p_msdv` VARCHAR(50)
)
BEGIN

	DECLARE SoNgayTBSN INT DEFAULT 0;
	DECLARE SoNgayTBTK INT DEFAULT 0;
	DECLARE SoNgayTBHH INT DEFAULT 0;
	
	SELECT IFNULL((SELECT giatri FROM onebis_control.thamsohethong WHERE mshs = p_mshs AND msdv = p_msdv AND msthamso = 'TBSN'),0) INTO SoNgayTBSN;
	SELECT IFNULL((SELECT giatri FROM onebis_control.thamsohethong WHERE mshs = p_mshs AND msdv = p_msdv AND msthamso = 'TBTK'),0) INTO SoNgayTBTK;
	SELECT IFNULL((SELECT giatri FROM onebis_control.thamsohethong WHERE mshs = p_mshs AND msdv = p_msdv AND msthamso = 'TBHH'),0) INTO SoNgayTBHH;
			
	SELECT 1 vitri, '#00b050' color, 'Khách hàng' loai,  COUNT(rowid)sl FROM hosokhachhang
	WHERE mshs = p_mshs AND msdv = p_msdv
UNION ALL 
	SELECT 1 vitri,'#7030A0' color,'Lịch hẹn' loai, COUNT(distinct (sodienthoai))sl FROM banhang_line
	WHERE mshs= p_mshs AND msdv= p_msdv and CURDATE() = DATE(ngayhen) 		
UNION ALL	 
	SELECT 1 vitri,'#db549d' color,'Sinh nhật' loai, COUNT(rowid)sl FROM hosokhachhang
	WHERE DATE_ADD(ngaysinh, INTERVAL YEAR(CURDATE())-YEAR(ngaysinh) + IF(DAYOFYEAR(CURDATE()) > DAYOFYEAR(ngaysinh),1,0) YEAR)  
	BETWEEN CURDATE() AND DATE_ADD(CURDATE(), INTERVAL SoNgayTBSN DAY) and mshs= p_mshs AND msdv= p_msdv;
-- UNION ALL	 	
-- 	SELECT 2 vitri,'#c18c00' color,'Đặt hàng' loai, COUNT(a.rowid) FROM tonkho a INNER JOIN hosohanghoa b ON a.mshh = b.mshh
