CREATE PROCEDURE `Show_DieuTour`(
	IN `p_msdv` CHAR(50)
)
BEGIN
 
DROP TABLE IF EXISTS tam;
CREATE TEMPORARY TABLE tam(
	-- Lấy số tour hôm qua mang sang
	SELECT msnv, tennv, COUNT(rowid)sotour, MAX(time_thuchien)timethuchien FROM nhatky_thuchien
		WHERE DATE(time_thuchien) = DATE_ADD(CURDATE(), INTERVAL -1 DAY)
		AND msdv = p_msdv AND loai<> 'CD'
		AND msnv NOT IN (SELECT msnv FROM hosochamcong 
		WHERE CURDATE() BETWEEN tungay AND denngay AND loai='1' AND trangthai='1' AND msdv = p_msdv)
		GROUP BY msnv
	UNION all
	-- Lấy danh sách hôm nay
	SELECT a.msdn AS msnv, b.hoten AS tennv, 0 sotour, '0000-00-00 00:00:00' timethuchien
		from hosophanquyen a INNER JOIN hosonhanvien b
		ON a.msdn = b.sodienthoai AND a.msdv=b.msdv
		AND a.msdv = p_msdv AND b.khoa=0
		AND a.manghiepvu='Journal'
		AND a.msdn NOT IN (SELECT msnv FROM hosochamcong 
		WHERE CURDATE() BETWEEN tungay AND denngay AND loai='1' AND trangthai='1' AND msdv = p_msdv)
		GROUP BY a.msdn
	UNION ALL  
	-- Lấy số tour hôm nay
	SELECT msnv, tennv, COUNT(rowid)sotour, MAX(time_thuchien)timethuchien FROM nhatky_thuchien
		WHERE time_hoanthanh <> '0000-00-00 00:00:00'
		AND CURDATE() = DATE(time_thuchien)
		AND msdv = p_msdv AND loai<> 'CD'
		GROUP BY msnv
	ORDER BY sotour, timethuchien
);
	SELECT msnv, tennv, SUM(sotour)sotour FROM tam
	GROUP BY msnv 
	ORDER BY sotour LIMIT 1;
END//
