-- Dumping structure for procedure onebis.Show_GiaDV
DELIMITER //
CREATE PROCEDURE `Show_GiaDV`(
	IN `p_mshs` CHAR(50),
	IN `p_msdv` CHAR(50),
	IN `p_msdichvu` CHAR(50),
	IN `p_masomota` CHAR(50),
	IN `p_loai` CHAR(50)
)
BEGIN
	DECLARE SoTienMuonThu DOUBLE DEFAULT 0;
	DECLARE TongTienHT DOUBLE DEFAULT 0;
	DECLARE DonGiaDanhMuc DOUBLE DEFAULT 0;
	DECLARE PhanTram Float DEFAULT 0;

	SET SoTienMuonThu = (SELECT ifnull((SELECT sotien FROM hosodichvu WHERE msdichvu = p_msdichvu AND msdv=p_msdv),0));
	SET DonGiaDanhMuc = (SELECT ifnull((SELECT sotien FROM hosodichvu WHERE msdichvu = p_masomota AND msdv=p_msdv),0));
	SET DonGiaDanhMuc = DonGiaDanhMuc + (SELECT ifnull((SELECT giaban FROM hosohanghoa WHERE mshh = p_masomota AND msdv=p_msdv),0));
	SET TongTienHT = DonGiaDanhMuc + (SELECT IFNULL(SUM(sotien),0) FROM hosodichvu 
							WHERE msdichvu IN (SELECT mshh FROM motadichvu WHERE msdichvu=p_msdichvu AND msdv=p_msdv)
							AND msdv=p_msdv);
	SET PhanTram = 100 - ROUND((SoTienMuonThu/TongTienHT)*100,0);
	SET DonGiaDanhMuc = ROUND(DonGiaDanhMuc - ((DonGiaDanhMuc * PhanTram)/100),0);
	
	if(p_loai='ShowGia')then
	SELECT ifnull(DonGiaDanhMuc,0)DonGia;
	END if;
	
	if(p_loai='Luu')then
		UPDATE motadichvu a INNER JOIN 
		(
			SELECT msdichvu, sotien, msdv from hosodichvu 
			WHERE msdv=p_msdv 	
			AND msdichvu IN (SELECT mshh FROM motadichvu WHERE msdichvu=p_msdichvu AND msdv=p_msdv)		
			GROUP BY msdichvu
		) b
		ON a.mshh = b.msdichvu AND a.msdv = b.msdv 
		SET a.dongia = ROUND(b.sotien - ((b.sotien * PhanTram)/100),0)
		WHERE a.msdv=p_msdv AND a.msdichvu= p_msdichvu;

	END if;
END//
DELIMITER ;

-- Dumping structure for procedure onebis.Show_HenKhach
DELIMITER //
CREATE PROCEDURE `Show_HenKhach`(
	IN `_msdv` CHAR(50) CHARSET utf8mb3,
	IN `_keyword` VARCHAR(50)
)
BEGIN 
DROP TABLE IF EXISTS tam;
CREATE TEMPORARY TABLE tam
(
	SELECT soct, DATE_FORMAT(ngayhen, '%H:%i')thoigian, tenhh as tenkh, sodienthoai AS sdt, msdv,
	CONCAT(SUBSTRING(sodienthoai,1,4),'.',SUBSTRING(sodienthoai,5,3),'.',SUBSTRING(sodienthoai,8,3))sodienthoai,
	tenlieutrinh, 0 tongcong, 0 dathanhtoan, 0 conno, mach, nhietdo, huyetap, nhiptho, chieucao, cannang,  0 tiendo,
	tenhh AS tennv, CONCAT('2343/',tenhh) AS dichvu, thuchien, msdv_lieutrinh, mslieutrinh, if(nhom_hh = 'DV',1,0) tonglan, if(thuchien = 3 && nhom_hh = 'DV',1,0) dathuchien
	FROM banhang_line 
	WHERE nhom_hh IN ('LT', 'DV')
	AND msdv = _msdv
	AND tam = 0
	AND DATE(ngayhen) = CURDATE()
	GROUP BY sdt, msdv_lieutrinh, soct
	ORDER BY rowid
);
	UPDATE tam SET tenkh='', tennv='', dichvu='';
		
	-- UPDATE KHÁCH HÀNG, ĐÃ THANH TOÁN, CÒN NỢ
	UPDATE tam a INNER JOIN banhang_header b
	ON a.soct = b.soct AND a.sdt = b.sodienthoai
	SET a.tenkh = b.tenkh, a.tongcong = b.tongcong, a.dathanhtoan = b.dathanhtoan, a.conno = b.tongcong - b.dathanhtoan
	WHERE b.msdv=_msdv;
	
	
	
	
	-- XÓA KHÁCH ĐẶT
	DELETE FROM tam WHERE soct IN (SELECT soct FROM banhang_header WHERE msdv=_msdv AND dathen = 1) AND msdv=_msdv;

	-- UPDATE DỊCH VỤ 
	-- 2024-01-03 thêm điều kiện mslieutrinh = '' chỉ hiển thị những thằng cha, không hiện chi tiết
	UPDATE tam a INNER JOIN 
	(
		SELECT msdv_lieutrinh, sodienthoai, replace(GROUP_CONCAT(rowid, '/' ,tenhh),',','|') AS dichvu, msdv, soct, MAX(thuchien)thuchien  from banhang_line 
		WHERE DATE(ngayhen) = CURDATE()
		AND nhom_hh NOT IN ('LT', 'DVLT', 'DT', 'VC','GDV','HH')
		AND tam = 0
		AND msdv=_msdv 
		AND ((mslieutrinh = '' AND tenlieutrinh = '') OR (mslieutrinh <> '' AND tenlieutrinh <> ''))
		GROUP BY sodienthoai, msdv, soct, msdv_lieutrinh
	) b
	ON a.sdt = b.sodienthoai AND a.msdv = b.msdv AND a.soct = b.soct AND a.msdv_lieutrinh = b.msdv_lieutrinh
	SET a.dichvu = b.dichvu, a.thuchien = b.thuchien;
	
	-- UPDATE NGƯỜI THỰC HIỆN
	UPDATE tam a INNER JOIN 
	(
		SELECT a.msdv_lieutrinh, a.sodienthoai, a.msdv, a.soct, b.rowidtc, replace(GROUP_CONCAT(b.tennv),',','|') AS tennv  
		FROM banhang_line a INNER JOIN nhatky_thuchien b ON a.rowid = b.rowidtc
		WHERE DATE(a.ngayhen) = CURDATE() 
		AND a.nhom_hh NOT IN ('LT', 'DVLT', 'DT', 'VC','GDV')
		AND a.tam = 0 AND b.loai='TH'
		AND a.msdv=_msdv
		GROUP BY a.sodienthoai, a.msdv, a.soct, b.rowidtc, a.msdv_lieutrinh	
	) b
	ON a.sdt = b.sodienthoai AND a.msdv = b.msdv AND a.soct = b.soct AND a.msdv_lieutrinh = b.msdv_lieutrinh
	SET a.tennv = b.tennv;

	-- Có liệu trình
	UPDATE tam a INNER JOIN 
	(
		SELECT COUNT(mslieutrinh)tonglan, sodienthoai, msdv, soct FROM banhang_line 
		WHERE nhom_hh='LT' AND msdv=_msdv 
		GROUP BY sodienthoai, soct
	) b
	ON a.sdt = b.sodienthoai AND a.msdv = b.msdv AND a.soct = b.soct
	SET a.tonglan = b.tonglan
	WHERE a.mslieutrinh <> ''	;
	
	-- Không liệu trình
	UPDATE tam a INNER JOIN 
	(
		SELECT COUNT(mslieutrinh)tonglan, sodienthoai, msdv, soct FROM banhang_line 
		WHERE mslieutrinh = '' AND msdv=_msdv AND DATE(ngayhen) = CURDATE()
		GROUP BY sodienthoai, soct
	) b
	ON a.sdt = b.sodienthoai AND a.msdv = b.msdv AND a.soct = b.soct
	SET a.tonglan = b.tonglan
	WHERE a.mslieutrinh = ''	;
	
	
	UPDATE tam a INNER JOIN 
	(
		SELECT COUNT(rowid)dathuchien, soct, sodienthoai, msdv FROM banhang_line
		WHERE  nhom_hh = 'LT' AND thuchien = 3  
		AND msdv=_msdv
		GROUP BY sodienthoai, soct
	) b
	ON a.sdt = b.sodienthoai AND a.msdv = b.msdv AND a.soct = b.soct
	SET a.dathuchien = b.dathuchien
	WHERE a.mslieutrinh <> ''	;
	
	-- Không liệu trình
	UPDATE tam a INNER JOIN 
	(
		SELECT COUNT(rowid)dathuchien, soct, sodienthoai, msdv FROM banhang_line
		WHERE  mslieutrinh = '' AND thuchien = 3  AND DATE(ngayhen) = CURDATE()
		AND msdv=_msdv
		GROUP BY sodienthoai, soct
	) b
	ON a.sdt = b.sodienthoai AND a.msdv = b.msdv AND a.soct = b.soct
	SET a.dathuchien = b.dathuchien
	WHERE a.mslieutrinh = ''	;
	
	UPDATE  tam set tiendo = ifnull(ROUND((ifnull(dathuchien,0)/tonglan)*100,0),0);
	


	
	SELECT * FROM tam;	
	
END//
DELIMITER ;

