	if(b.ms_nguoithan<>'', (select gioitinh from hosonguoithan where ms_nguoithan = b.ms_nguoithan and sodienthoai=b.sodienthoai and b.mshs = mshs),a.gioitinh)gioitinh, 
	CONCAT(SUBSTRING(b.sodienthoai,1,4),'.',SUBSTRING(b.sodienthoai,5,3),'.',SUBSTRING(b.sodienthoai,8,3))sodienthoai,  
	a.diachi, DATE_FORMAT(b.ngaykb, '%d/%m/%Y')ngay_kb,                 
