	b.tongcong,(b.tongcong - b.dathanhtoan)conno,b.dathanhtoan                       
	from banhang_header b inner join hosokhachhang a on a.sodienthoai=b.sodienthoai and a.mshs=b.mshs and a.mshs = p_mshs                 
	where b.mshs = p_mshs and b.msdv=p_msdv and b.ngaykb = CURRENT_DATE and b.dathen=0
	and (a.tenkh like CONCAT('%',p_keyword,'%') or a.sodienthoai like CONCAT('%',p_keyword,'%') or a.mskh like CONCAT('%',p_keyword,'%') or b.ms_nguoithan like CONCAT('%',p_keyword,'%'))
	ORDER BY a.sttkb * 1, b.tenkh;
	
	
ELSE
	SELECT * FROM 
