		if(b.ms_nguoithan<>'', (select gioitinh from hosonguoithan where ms_nguoithan = b.ms_nguoithan and sodienthoai=b.sodienthoai and b.mshs = mshs),a.gioitinh)gioitinh, 
		CONCAT(SUBSTRING(b.sodienthoai,1,4),'.',SUBSTRING(b.sodienthoai,5,3),'.',SUBSTRING(b.sodienthoai,8,3))sodienthoai,  
		a.diachi, DATE_FORMAT(b.ngaykb, '%d/%m/%Y')ngay_kb,                 
		DATE_FORMAT(a.ngay_tk, '%d/%m/%Y')ngay_tk, a.sttkb, a.nghenghiep,b.sodienthoai as sdt, b.trangthai, b.soct, a.nhom_kh,
		b.tongcong,(b.tongcong - b.dathanhtoan)conno,b.dathanhtoan                       
		from banhang_header b inner join hosokhachhang a on a.sodienthoai=b.sodienthoai and a.mshs=b.mshs and a.mshs = p_mshs                 
		where b.mshs = p_mshs and b.msdv=p_msdv and b.ngaykb = CURRENT_DATE and b.dathen=0
		and (a.tenkh like CONCAT('%',p_keyword,'%') or a.sodienthoai like CONCAT('%',p_keyword,'%') or a.mskh like CONCAT('%',p_keyword,'%') or b.ms_nguoithan like CONCAT('%',p_keyword,'%')) 
		
		UNION ALL
		
