			SELECT 'Bệnh cũ' as  loai, 0 vitri, a.mskh,a.tenkh, b.ms_nguoithan ,b.ten_nguoithan,  a.ngaysinh, year(CURDATE()) - year(b.ngaysinh)tuoi, a.gioitinh,
