			UNION ALL -- LẤY KHÁCH HÀNG
			SELECT 'Bệnh cũ' as  loai, 0 vitri, a.mskh,a.tenkh,'' ms_nguoithan,  '' ten_nguoithan,  a.ngaysinh, year(CURDATE()) - year(a.ngaysinh)tuoi, a.gioitinh,
