			DATE_FORMAT(a.ngay_tk, '%d/%m/%Y')ngay_tk, '0' sttkb, a.nghenghiep,a.sodienthoai as sdt, 0 trangthai, a.soct, a.nhom_kh,
			0 tongcong, 0 conno, 0 dathanhtoan        
