DELIMITER //
CREATE PROCEDURE `Show_NhanVien`(
	IN `p_msdv` CHAR(50)
)
BEGIN
DROP TABLE IF EXISTS tam;
CREATE TEMPORARY TABLE tam(

	SELECT SUM(ban)ban, msnv, tennv, msdv, '' loai FROM 
	(
		SELECT 0 as ban, a.msdn AS msnv, b.hoten AS tennv, a.msdv, '' loai
		from hosophanquyen a INNER JOIN hosonhanvien b
		ON a.msdn = b.sodienthoai AND a.msdv=b.msdv
		AND a.msdv = p_msdv AND b.khoa=0
		AND a.manghiepvu='Journal'
		AND a.msdn NOT IN (SELECT msnv FROM hosochamcong WHERE CURDATE() BETWEEN tungay AND denngay AND loai='1' AND trangthai='1' AND msdv = p_msdv)
		GROUP BY a.msdn
	UNION ALL
		SELECT SUM(ban)ban, msnv, tennv, msdv, loai FROM 
		(
		SELECT 1 as ban, msnv, tennv, msdv, loai  FROM nhatky_thuchien 
		WHERE time_hoanthanh = '0000-00-00 00:00:00'
		AND CURDATE() = DATE(time_thuchien)
		AND msdv = p_msdv AND loai<> 'CD'
		GROUP BY msnv
		UNION all
		SELECT 0 as ban, msnv, tennv, msdv, loai   FROM nhatky_thuchien 
		WHERE time_hoanthanh <> '0000-00-00 00:00:00'
		AND CURDATE() = DATE(time_thuchien)
		AND msdv = p_msdv AND loai<> 'CD'
		GROUP BY msnv
		)
		a GROUP BY msnv
	)
	b GROUP BY msnv

);
 
	SELECT b.rowidtc,a.msnv, a.tennv, a.ban,
	CASE WHEN a.ban = '1' then ifnull(time_format(b.time_thuchien,"%H:%i"),'') ELSE '' END vao,
	CASE WHEN a.ban = '1' then ifnull(TIME_FORMAT(timediff(NOW(), b.time_thuchien), "%H:%i"),'') ELSE '' END tg,
	CASE WHEN a.ban = '1' then ifnull(c.tenhh,'') ELSE '' END tenhh
		FROM tam a
		LEFT JOIN nhatky_thuchien b 
		ON a.msnv = b.msnv AND a.msdv = b.msdv AND CURDATE() = DATE(b.time_thuchien)  AND b.time_hoanthanh = '0000-00-00 00:00:00'
		LEFT JOIN banhang_line c
		ON b.rowidtc = c.rowid  AND a.msdv = c.msdv
		WHERE a.msdv = p_msdv
		ORDER BY a.ban, a.tennv;
				
END//
DELIMITER ;

