DELIMITER //
CREATE PROCEDURE `ThemXuatKho_TruKho`(
	IN `_SoCTBanHang` CHAR(30) CHARSET utf8mb3,
	IN `_MaCN` CHAR(30) CHARSET utf8mb3
)
    NO SQL
BEGIN
-- BIẾN VÒNG LẶP
DECLARE TongSoDong_ INT DEFAULT 0;
DECLARE SoDongHienTai_ INT DEFAULT 0;

DECLARE MSHHDongHienTai_  CHAR(60);
DECLARE SoLuongDongHienTai_ DOUBLE DEFAULT 0;
DECLARE CoLine_ INT DEFAULT 0;
DECLARE _LoaiXuat CHAR(40) DEFAULT '';


-- BIẾN TRỪ KHO, XUẤT KHO
DECLARE TonCuoi_TK_ INT DEFAULT 0;
DECLARE RowID_TK_ DOUBLE;
DECLARE GiaNhapCoThue_TK_ FLOAT; 
DECLARE SoLuongXuat_ DOUBLE;
DECLARE GiaTriXuat_ DOUBLE;
DECLARE HanDung_TK_ DATE;
DECLARE TongTonKho_ DOUBLE;
DECLARE SoVongLap_ INT DEFAULT 0;
DECLARE SoLo_TK_ CHAR(60);
DECLARE MSNPPDongHienTai_ CHAR(60);



CALL `LayTonKhoBaoCao`('', _MaCN, CURRENT_DATE() , CURRENT_DATE() , 'CN');

DELETE FROM xuatkho_line WHERE soct = replace(_SoCTBanHang,'DH','XK') AND msdv = _MaCN ;
DELETE FROM xuatkho_header WHERE soctdh = _SoCTBanHang AND msdv = _MaCN ;
SET _LoaiXuat = (SELECT IFNULL((SELECT msloai FROM dmphanloai WHERE phanloai='loaixuat' AND dieukien2='XBH' AND msdv = _MaCN LIMIT 1),''));

SELECT COUNT(a.soluong) INTO TongSoDong_  FROM (SELECT COUNT(DISTINCT mshh) soluong  FROM `banhang_line` WHERE soct = _SoCTBanHang AND msdv = _MaCN AND nhom_hh IN ( 'HH', 'DT' ) AND tam = '0' GROUP BY soct, mshh) a ;
SET SoDongHienTai_=0;
-- LẶP HẾT TẤT CẢ DÒNG THEO SỐ CHỨNG TỪ
WHILE SoDongHienTai_< TongSoDong_ DO 
 -- BẮT ĐẦU KIỂM TRA ĐỦ KHO
 -- INSERT INTO table_B(ID, VAL) SELECT (ID, VAL) FROM table_A LIMIT SoDongHienTai_,1;
    SELECT mshh  INTO MSHHDongHienTai_ FROM banhang_line WHERE soct = _SoCTBanHang AND msdv = _MaCN AND nhom_hh IN ( 'HH', 'DT' ) AND tam = '0' GROUP BY mshh ORDER BY mshh LIMIT SoDongHienTai_,1;
    SELECT SUM(soluong_xuat) soluong INTO SoLuongDongHienTai_ FROM `banhang_line` WHERE soct = _SoCTBanHang AND msdv = _MaCN AND nhom_hh IN ( 'HH', 'DT' ) AND tam = '0' GROUP BY mshh ORDER BY mshh LIMIT SoDongHienTai_,1 ;
    SELECT msncc  INTO MSNPPDongHienTai_ FROM `hosohanghoa` WHERE mshh = MSHHDongHienTai_ AND msdv = _MaCN ;

    SELECT IFNULL(SUM(toncuoi), 0)Ton  INTO TongTonKho_ FROM tonkho WHERE mshh = MSHHDongHienTai_ AND handung > CURRENT_DATE()   ORDER by mshh;
 	SET SoDongHienTai_ = SoDongHienTai_ + 1;


    IF (TongTonKho_ >= SoLuongDongHienTai_) THEN
        SET SoLuongXuat_ = SoLuongDongHienTai_;
        SET SoVongLap_ = 0;
        WHILE (SoLuongXuat_ > 0) DO
          SELECT rowid INTO RowID_TK_ FROM tonkho WHERE mshh = MSHHDongHienTai_ AND handung > CURRENT_DATE() AND toncuoi > 0 ORDER BY handung LIMIT SoVongLap_, 1;
          SELECT toncuoi INTO TonCuoi_TK_ FROM tonkho WHERE rowid = RowID_TK_;
          SELECT solo INTO SoLo_TK_ FROM tonkho WHERE rowid = RowID_TK_;
          SELECT handung INTO HanDung_TK_ FROM tonkho WHERE rowid = RowID_TK_;
          SELECT gianhapcothue INTO GiaNhapCoThue_TK_ FROM tonkho WHERE rowid = RowID_TK_;

              -- CẬP NHẬT LẠI SỐ LƯỢNG XUẤT
             IF (SoLuongXuat_ <= TonCuoi_TK_) THEN 
                SET GiaTriXuat_ = SoLuongXuat_;
             ELSE 
                SET GiaTriXuat_ = TonCuoi_TK_;
             END IF;

             SET SoVongLap_ = SoVongLap_ + 1;
             SET SoLuongXuat_ = (SoLuongXuat_ - GiaTriXuat_);
             
             -- ĐẨY XUẤT KHO LINE
             SELECT RowID_TK_, NOW(),a.msdn,a.mshs,a.msdv,'',MSNPPDongHienTai_, '', a.ngay, replace(a.soct,'DH','XK'), a.mshh,a.tenhh,a.dvt,'1900-01-01',SoLo_TK_,HanDung_TK_,GiaTriXuat_,a.msctkm, GiaNhapCoThue_TK_, a.giaban, a.ptgiam, a.giathuvat, a.thuesuat, GiaTriXuat_ * a.giathu, GiaTriXuat_ * a.giathuvat, '0',_LoaiXuat, '', '0', '0', '0'   
				 FROM banhang_line a WHERE a.soct = _SoCTBanHang AND a.msdv = _MaCN AND a.mshh = MSHHDongHienTai_ LIMIT 1;

		SET CoLine_ = 1;

        END WHILE;
    END IF;
END WHILE;

IF(CoLine_ = 1) THEN
	`mskh`, `tenkhachhang`, `msnvbh`, `dathanhtoan`, `qrthanhtoan`, `sophieuthu`, `nganquy`, `ghichu`, `nguon`) 
	SELECT NOW(), b.msdn, b.mshs, b.msdv, a.soct, replace(b.soct,'DH','XK'), '', b.ngay, b.ngay, SUM(b.thanhtienvat), _LoaiXuat, 
	a.mskh, a.tenkh, b.msdn, '0', '', '', '', '', ''  FROM banhang_header a INNER JOIN xuatkho_line b on a.soct = replace(b.soct,'XK','DH') and a.msdv = b.msdv
	WHERE a.soct= _SoCTBanHang
	GROUP BY b.msdn, b.mshs, b.msdv, b.soct, b.ngay, a.mskh, a.tenkh;
END IF;

END//
