DELIMITER //
CREATE PROCEDURE `TinhLuongNhanVien`(
	IN `p_mshs` CHAR(50),
	IN `p_msdv` CHAR(50),
	IN `p_tungay` DATE,
	IN `p_denngay` CHAR(50),
	IN `p_msdn` CHAR(50)
)
BEGIN

DROP TABLE IF EXISTS tam;
CREATE TEMPORARY TABLE tam
(
	SELECT CONCAT(a.sodienthoai,' | ', a.hoten) AS nhanvien, a.sodienthoai, a.hoten, 0 thuchien, 0 doanhso, 0 hoahong,
	SUM(luongcoban)luongcoban, 0 songaynghi, b.dieukien AS songay_duocnghi, 0 ngaycong, 0 luongngaycong, b.dieukien1 AS phucap, SUM((luongcoban* b.dieukien1)/100) AS tienphucap, 0 tamung, 0 tongnhan, b.tenloai, a.msdv
	FROM hosonhanvien a 
	INNER JOIN dmphanloai b ON a.mschucvu = b.msloai
	WHERE a.msdv = p_msdv
	GROUP BY a.sodienthoai

);
	-- GET DOANH THU, DOANH SỐ, HOA HONG
	UPDATE tam a LEFT JOIN 
	(
		SELECT COUNT(msnv)thuchien, msdv, msnv, round(sum(ptthuchien * sotienhuong)/100,0)hoahong, sum(doanhso)doanhso
		FROM nhatky_thuchien WHERE msdv=p_msdv
		AND date(time_hoanthanh) BETWEEN p_tungay AND p_denngay
		GROUP BY msnv
	) b
	ON a.sodienthoai = b.msnv AND a.msdv = b.msdv
	SET a.thuchien = b.thuchien, a.hoahong = b.hoahong, a.doanhso = b.doanhso
	WHERE a.msdv=p_msdv AND b.msdv=p_msdv;
	
	-- GET TẠM ỨNG
	UPDATE tam a LEFT JOIN 
	(
		SELECT ABS(SUM(sotien))tamung, msnv, msdv FROM thuchi 
		WHERE makhoanmuc in (SELECT msloai FROM dmphanloai WHERE dieukien2 IN ('TTU','CTU') and msdv = p_msdv)
		AND msdv = p_msdv AND ngay BETWEEN p_tungay AND p_denngay
		GROUP BY msnv
	) b
	ON a.sodienthoai = b.msnv AND a.msdv = b.msdv
	SET a.tamung = b.tamung
	WHERE a.msdv=p_msdv AND b.msdv=p_msdv;
	-- GET NGÀY NGHỈ
	UPDATE tam a LEFT JOIN 
	(
		SELECT sum(DATEDIFF(denngay, tungay)+1)songaynghi, msnv, msdv FROM hosochamcong 
		where msdv=p_msdv and loai=1 and trangthai=1  and MONTH(CURDATE())=MONTH(denngay)
		GROUP BY msnv
	) b
	ON a.sodienthoai = b.msnv AND a.msdv = b.msdv
	SET a.songaynghi = b.songaynghi
	WHERE a.msdv=p_msdv AND b.msdv=p_msdv;
	
	-- TÍNH TOÁN TỔNG NHẬN
	UPDATE tam SET ngaycong = 30 + songay_duocnghi - songaynghi, luongngaycong = (30 - (songaynghi - songay_duocnghi)) * ROUND((luongcoban/30),0) WHERE msdv=p_msdv;
	UPDATE tam SET tongnhan = luongngaycong+hoahong+tienphucap - tamung WHERE msdv=p_msdv;
	
	-- Post Bảng lương
	DELETE FROM bangluong WHERE mshs = p_mshs AND msdv = p_msdv AND tungay = p_tungay AND denngay = p_denngay AND trangthai = 0;
	doanhso, hoahong, luongcoban, songay_duocnghi, songaynghi, ngaycong, luongngaycong, tienphucap, khoantru, tongnhan, sophieuchi, phucap, chucvu, tamung)
	SELECT NOW(), p_msdn, 0, p_mshs, p_msdv, p_tungay, p_denngay, sodienthoai, hoten, thuchien,
	doanhso, hoahong, luongcoban, songay_duocnghi, songaynghi, ngaycong, luongngaycong, tienphucap, 0, tongnhan, '', phucap, tenloai, tamung
	FROM tam WHERE msdv=p_msdv
	;
END//
DELIMITER ;

