CREATE PROCEDURE `UpdateNhomKH`(
	IN `_mshs` CHAR(50) CHARSET utf8mb3,
	IN `_dienthoai` CHAR(50) CHARSET utf8mb3
)
BEGIN
DECLARE DoanhThu DOUBLE;
DECLARE ConNo DOUBLE;
DECLARE NhomKH_Update CHAR(50);
	SELECT ifnull(SUM(tongcong),0) FROM banhang_header WHERE mshs=_mshs AND sodienthoai = _dienthoai INTO DoanhThu;
	SELECT IFNULL((SELECT msnhom FROM nhom_khachhang WHERE sotientu <= DoanhThu AND DoanhThu <= sotienden AND mshs=_mshs ORDER BY sotienden DESC LIMIT 1),
	(SELECT msnhom FROM nhom_khachhang WHERE mshs=_mshs ORDER BY sotienden DESC LIMIT 1)) INTO NhomKH_Update;
	UPDATE hosokhachhang SET nhom_kh = NhomKH_Update WHERE mshs=_mshs AND sodienthoai = _dienthoai;
	
	SELECT ifnull(SUM(tongcong-dathanhtoan),0) FROM banhang_header WHERE mshs=_mshs AND sodienthoai = _dienthoai INTO ConNo;
	SELECT if(ConNo<0,'Số dư: ','Còn nợ: ')text, abs(ConNo)ConNo, phantramgiam, NhomKH_Update AS ms_nhom, CONCAT(tennhom, ' (', phantramgiam,'%)')tennhom_full
	FROM nhom_khachhang WHERE msnhom = NhomKH_Update AND  mshs=_mshs;

END//
