CREATE PROCEDURE `XoaThuChi`(
	IN `_msdv` CHAR(50) CHARSET utf8mb3,
	IN `_msdn` CHAR(50) CHARSET utf8mb3,
	IN `_soct` CHAR(50) CHARSET utf8mb3,
	IN `_socttc` CHAR(50),
	IN `_sotien` DOUBLE
)
BEGIN
	DECLARE ThuBanHang NVARCHAR(50) DEFAULT '';
	DECLARE ThongBao NVARCHAR(200) DEFAULT '';
	DECLARE DaThu_ DOUBLE DEFAULT 0;
	DECLARE PhanQuyen DOUBLE DEFAULT 0;
	DECLARE DaXoa DOUBLE DEFAULT 0;
	
		SET PhanQuyen = (SELECT COUNT(rowid) FROM hosophanquyen WHERE msdv= _msdv AND msdn = _msdn AND manghiepvu = 'XTC');
		if (PhanQuyen = 0 ) then 
			SET ThongBao = 'Tài khoản chưa được cấp quyền Xóa, vui lòng liên hệ người phụ trách'; SET DaXoa = 0;
			SELECT ThongBao, DaXoa;
		END if;
		
	   if (PhanQuyen <> 0 ) then 	
		
			SET ThuBanHang = (SELECT IFNULL((SELECT makhoanmuc FROM thuchi WHERE soct=_soct AND msdv= _msdv AND makhoanmuc='TBH'),''));			
			if(ThuBanHang<>'') then
				UPDATE banhang_header SET socttc = REPLACE(socttc,CONCAT(_soct, '|'),''), dathanhtoan = dathanhtoan - _sotien WHERE soct=_socttc AND msdv= _msdv;
			END if;
				DELETE FROM thuchi WHERE soct=_soct AND msdv= _msdv;
				SET ThongBao='Đã Xóa phiếu'; SET DaXoa = 1;
				SELECT ThongBao, DaXoa;
		END if;
END//
