	IN `p_sohopdong` CHAR(30),
	IN `p_giahopdong` CHAR(30),
	IN `p_sothangkm` CHAR(5),
	IN `p_msdvtaitro` CHAR(30),
	IN `p_ghichu` VARCHAR(500),
	IN `p_dienthoaicongtacvien` CHAR(30),
	IN `p_sonam` INT,
	IN `p_dienthoaihotro` CHAR(50),
	IN `p_them` INT,
	IN `p_nguoigiahan` CHAR(20)
)
    NO SQL
BEGIN
	DECLARE TinhHuyenXa NVARCHAR(200) DEFAULT '';
	DECLARE ThongBao NVARCHAR(200) DEFAULT '';
	DECLARE TenTinh NVARCHAR(100) DEFAULT '';
	DECLARE NgayKH DATE ;
	DECLARE NgayHH DATE ;
	SET ThongBao = (SELECT COUNT(dienthoai) FROM hosodonvi WHERE dienthoai = p_dienthoai);
	SET TinhHuyenXa = (SELECT CONCAT(tenxa, ', ', tenhuyen, ', ', tentinh)diachi FROM dmtinh WHERE maxa=p_msxa);
	if(p_them = 1)then
		if(ThongBao =0) then
		-- CONTROL
			-- POST HOSODONVI 
			nguoidaidien, dienthoai, ips, dbs, usc, psc, dienthoaihotro, vitribando, datlich, keyword) 
			select NOW(), p_dienthoai, p_mshs, p_msdv, p_tendv, p_msxa, p_diachi, TinhHuyenXa, p_loaihinh,
			p_nguoidaidien, p_dienthoai, ips, dbs, usc, psc, if(p_dienthoaihotro='','0919  118 187 - Nhựt Tân',p_dienthoaihotro), '', '0', ''
			FROM  onebis_control.hosodonvi WHERE mshs = 'ONEBIS';
			
			-- POST NHATKYGIAHAN
			UPDATE onebis_control.nhatky_giahan SET trangthai = 0 WHERE msdv = p_msdv;
			ngaykichhoat, sonam, sothangkm, ngayhethan, giahopdong, ghichu) 
			VALUES (NOW(),p_nguoigiahan,p_dienthoaicongtacvien,p_msdvtaitro,p_sohopdong,p_mshs,p_msdv,
			CURDATE(),p_sonam,p_sothangkm, DATE_ADD(ngaykichhoat, INTERVAL (p_sonam * 12) + p_sothangkm MONTH),p_giahopdong,p_ghichu);
				
			-- POST HOSONHANVIEN
			VALUES (NOW(),p_dienthoai,p_mshs,p_msdv,p_dienthoai,'202cb962ac59075b964b07152d234b70');
			
			-- POST THAM SỐ HỆ THỐNG
			SELECT NOW(), 'ACTIVE', p_mshs, p_msdv, kyhieuid, tenloai, dieukien1, ADMIN, dieukien  FROM onebis_control.dmphanloai_admin
			WHERE phanloai = 'TSHT' ORDER BY ADMIN;
				
		-- CLIENT
			-- POST DMPHANLOAI
				-- POST DM Chung
				tenloai, phanloai, tenphanloai, `admin`, dieukien, dieukien1, dieukien2)
				SELECT rowid, p_mshs,p_msdv, CONCAT(kyhieuid,DATE_FORMAT(now(), '%d%m%y%H%i%s'), LPAD(rowid, 4, 0)),
				tenloai, phanloai, tenphanloai, `admin`, dieukien, dieukien1, dieukien2  FROM onebis_control.dmphanloai_admin
				WHERE loaihinh='ALL' AND phanloai <> 'TSHT' ORDER BY phanloai, tenloai;
				
		 		-- POST DM THEO LOẠI HÌNH
				tenloai, phanloai, tenphanloai, admin, dieukien, dieukien1, dieukien2)
				SELECT rowid, p_mshs,p_msdv, CONCAT(kyhieuid,DATE_FORMAT(now(), '%d%m%y%H%i%s'), LPAD(rowid, 4, 0)),
				tenloai, phanloai, tenphanloai, admin, dieukien, dieukien1, dieukien2  FROM onebis_control.dmphanloai_admin
				WHERE loaihinh=p_loaihinh  AND  phanloai <> 'TSHT' ORDER BY phanloai, tenloai;
						
			-- POST HOSONHANVIEN
				`hoten`, `ngaysinh`, `gioitinh`, `diachi`, `ngaytuyendung`, `mschucvu`) 
				VALUES (NOW(),'1','LOAINV',p_dienthoai,p_mshs,p_msdv,p_dienthoai,p_nguoidaidien,'1900-01-01','NAM',p_diachi,CURDATE(),'MSCV');
				-- Cập nhật Loại nhân viên, Mã số chức vụ hosonhanvien
				UPDATE onebis.hosonhanvien SET mschucvu = 
				(SELECT msloai FROM onebis.dmphanloai 
				WHERE phanloai = 'chucvu' AND ADMIN = 1 AND dieukien2='CVU' AND msdv=p_msdv)
				WHERE ADMIN = '1' AND sodienthoai = p_dienthoai AND msdv=p_msdv;
				
				UPDATE onebis.hosonhanvien SET loai_nv = 
