				VALUES (NOW(), p_mshs, p_msdv,'ACTIVE', 'Câu chuyện của chúng tôi','Chúng tôi bắt đầu hành trình của mình trong lĩnh vực làm đẹp với mục tiêu làm thay đổi cách mọi người nhìn nhận và trải nghiệm. Từ lúc thành lập, chúng tôi luôn tập trung vào việc mang lại cho khách hàng những trải nghiệm làm đẹp tốt nhất và sẽ là nguồn cảm hứng để mọi người tự tin hơn.' ,
