DELIMITER //
CREATE PROCEDURE `Au_Login`(
	IN `_sodienthoai` CHAR(20) CHARSET utf8mb3,
	IN `_matkhau` CHAR(200) CHARSET utf8mb3
)
BEGIN

	DECLARE token NVARCHAR(200) DEFAULT '' ;
	DECLARE logined double DEFAULT 0;
	
	SELECT COUNT(a.rowid) INTO logined FROM hosonhanvien a
	INNER JOIN onebis.hosonhanvien b ON a.sodienthoai=b.sodienthoai AND a.msdv=b.msdv
	INNER JOIN hosodonvi c ON a.msdv = c.msdv
	WHERE a.sodienthoai = _sodienthoai AND c.trangthai = 0 AND a.khoa = 0 AND b.khoa = 0 AND a.matkhau  = MD5(_matkhau);
	
	if(logined=0) then
		SET logined = 0;
		SET token = 'Tài khoản chưa được TPSoft cấp quyền sử dụng';
		SELECT logined,token;
	else
		SET logined = 1;
		SELECT logined, _sodienthoai AS sodienthoai, a.loai_nv, a.hoten,a.mschucvu, b.mshs, b.msdv, b.tendv, b.loaihinh,b.dienthoaihotro FROM onebis.hosonhanvien a INNER JOIN hosodonvi b
		ON a.msdv = b.msdv WHERE a.sodienthoai = _sodienthoai;
	END if;
	
END//
