-- Dumping structure for procedure onebis_control.SetStatus_MSDV
DELIMITER //
CREATE PROCEDURE `SetStatus_MSDV`(
	IN `p_msdv` CHAR(50),
	IN `p_trangthai` INT
)
BEGIN
	if(p_trangthai=0) then
		UPDATE hosodonvi SET trangthai = 0 WHERE msdv = p_msdv AND msdv <>'ONEHIS';
	end if;
	if(p_trangthai=1) then
		UPDATE hosodonvi SET trangthai = 1 WHERE msdv = p_msdv AND msdv <>'ONEHIS';
	end if;
	if(p_trangthai=2) then
		UPDATE hosodonvi SET trangthai = 2 WHERE msdv = p_msdv AND msdv <>'ONEHIS';
	end if;
END//
DELIMITER ;

