-- Dumping structure for procedure onebis_control.Tool_Data
DELIMITER //
CREATE PROCEDURE `Tool_Data`(
	IN `p_mshs` CHAR(30),
	IN `p_msdv` CHAR(30),
	IN `p_loaihinh` CHAR(50),
	IN `p_loaitool` CHAR(50)
)
BEGIN
	DECLARE ThongBao NVARCHAR(200) DEFAULT '';
	SET ThongBao = (SELECT COUNT(rowid) FROM onebis_control.hosodonvi WHERE mshs=p_mshs AND msdv=p_msdv AND trangthai=0);
	if(ThongBao='0') then	
		SET ThongBao = CONCAT('MSHS: ' ,p_mshs,' | MSĐV: ' ,p_msdv, ' >> không tồn tại');				
	ELSE	
		CASE p_loaitool
			WHEN 'Copy_DMPhanLoai' THEN
				-- POST DM Chung
					tenloai, phanloai, tenphanloai, `admin`, dieukien, dieukien1, dieukien2)
					SELECT rowid, p_mshs,p_msdv, CONCAT(kyhieuid,DATE_FORMAT(now(), '%d%m%y%H%i%s'), LPAD(rowid, 4, 0)),
					tenloai, phanloai, tenphanloai, `admin`, dieukien, dieukien1, dieukien2  FROM onebis_control.dmphanloai_admin
					WHERE loaihinh='ALL' AND phanloai <> 'TSHT' AND rowid NOT IN (SELECT rowidtc FROM onebis.dmphanloai WHERE msdv=p_msdv)
					ORDER BY phanloai, tenloai;
					
			 	-- POST DM THEO LOẠI HÌNH
					tenloai, phanloai, tenphanloai, admin, dieukien, dieukien1, dieukien2)
					SELECT rowid, p_mshs,p_msdv, CONCAT(kyhieuid,DATE_FORMAT(now(), '%d%m%y%H%i%s'), LPAD(rowid, 4, 0)),
					tenloai, phanloai, tenphanloai, admin, dieukien, dieukien1, dieukien2  FROM onebis_control.dmphanloai_admin
					WHERE loaihinh=p_loaihinh  AND  phanloai <> 'TSHT' AND rowid NOT IN (SELECT rowidtc FROM onebis.dmphanloai WHERE msdv=p_msdv)
					ORDER BY phanloai, tenloai;
					
				-- POST THAM SỐ HỆ THỐNG
					SELECT NOW(), 'ACTIVE', p_mshs, p_msdv, kyhieuid, tenloai, dieukien1, ADMIN, dieukien  FROM onebis_control.dmphanloai_admin
					WHERE phanloai = 'TSHT'  AND kyhieuid NOT IN (SELECT msthamso FROM onebis_control.thamsohethong WHERE msdv=p_msdv) ORDER BY ADMIN;
		END case;
		SET ThongBao = 'Đã copy';
	END if;
	SELECT ThongBao;
END//
DELIMITER ;

